(185,1,'Cofisun','Ahoj, \r\n\r\no 8,00 hod ráno som zmenila na č. 23778 pozíciu zmluvy z 1 na pozíciu 2 a zadala som urýchlenie operácie. Obyčajne je zmena pozície vykonaná do 5 mínút. Už ubehli 2 hodiny a zmena pozície stále nie je prevedená, riadok v syntéze je stále zelený. Po prevedení zmeny riadok sčernie a pozícia bude zmenená na 2. Prosím o doriešenie, lebo v rámci jedného dňa musím previesť zmenu pozície 3x.Ďakujem. '),
