(190,4,'undefined','Prosim o ulozenie e-mailov z e-mailovej adresy externy.uctovnik@cofidis.sk a presmerovanie e-mailov na finance1@cofidis.sk, nasledne zrusenie uctu externeho uctovnika.'),
(191,1,'Cofisun','Hello,\r\n\r\nwe would like to create new fixed parameters of correspondence for Car products:\r\n\r\n1. IČO company_identification_number\r\n2. VIN vehicle_identification_number\r\n3. Rodné číslo klienta borrower_identification_number\r\n4. Značka vozidla brand_car\r\n5. Model vozidla type_car\r\n6. Rok výroby manufacture_year\r\n\r\nprintscreens are in the attachment\r\n\r\nBest regards'),
(192,1,'Cofisun','Ahojte \r\n\r\nv prílohe zasielam kontrakty, ktoré máju dvakrát odpočítaný poplatok v kolónke \"Výška úveru\". Raz natvrdo systémom, raz ručne, lebo sú to špeciálne bezpoplatkové kontrakty pre nášho partnera. Prioritne potrebujeme do zmluvy číslo 60003235 do kolónky \"Výška úveru\" dotiahnuť sumu 36 391,90 EUR, a potrebujeme aby sa zmena správne prejavila aj do amortizačnej tabuľky. V idálnom prípade opraviť všetky tri zmluvy. Nakoľko sa spätne poškodili pri iných globálnych úpravách.\r\n\r\nĎakujem,\r\nMarek Fecko\r\nSales Department\r\n\r\n'),
(193,1,'Cofisun','Ahojte,\r\n\r\nmam tu problem najvyššej priority. Klient je v bazáre. Partner B&B Autocar, naväčší v regióne North West dvakrát nahodil s.r.o. 4J Holding.  Ani raz neprepadla do CFS. Screeny pochopitelne nemáme, nevypísalo žiadne chybné hlášky. Spoločnosť 4J Holding má u ás odfianncovanú zmluvu spred 2 mesiacov. každopadne nie je dôvod na to aby sa absolutne nenachádzala v zozname žiadosti v ext, v to-do-liste v cfs a ani celkovo žiadosť v cfs, pri partnerovi.\r\n\r\nProsím o preverenie.\r\n\r\nĎakujem,\r\nMarek Fecko\r\nSales department'),
(194,1,'Cofisun','Ahoj,\r\n\r\nPoprosím o zadanie SARA tiketu o zlúčenie dvoch referencii, ide o tú istú spoločnosť WICR, S.R.O.\r\n\r\n01.170.653.101 – zmigrované žiadosti z Banif systému\r\n01.241.662.101 – nové žiadosti nahodené a chválené v CFS\r\n'),
(195,1,'Cofisun','Ahojte,\r\n\r\npri zmigrovanej zmluve 13614, sa zauctoval servisny poplatok vo výske 175€ z r.2013. V Banif systeme sme tento poplatok neevidovali ako omeškany obr.1 a preto sme tuto akciu ani neocakavali. V ktorej maske alebo na akom presne  mieste by sme tento konkretny poplatok mali vidiet ? V maske \"Informace ucet\" ho nevidim obr.2 '),
