(212,1,'Cofisun','Ahojte IT majstri.\r\nNižšie pripájam screeny asymetrie medzi informáciami v systéme a v províznom liste. Listy aj report sú ťahané z WEBI.\r\nPodľa systému je financovaná čiastka 14890 eur, podľa listu 29780 eur.\r\nPodľa systému je PD 2%, podľa listu 1%.\r\nČo sa týka sumy PD je to v poriadku nakoľko je reálna financovaná suma presná polovica zo zdvojnásobenej sumy uvedenej v liste...a PD presne naopak. \r\nProsím o preverenie, kde všade sa toto deje, nakoľko nie je v mojich silách kontrolovať list po liste a porovnávať s reportom. A spomenutý list nemôžem poslať partnerovi.\r\nMy sa teda do nápravy nejako vynájdeme, len prosím o opravu spôsobu doťahovania dát. \r\n\r\nPekný deň,\r\nMarek\r\n'),
