(232,1,'Cofisun','Ahojte,\r\n\r\nprišla ku nám žiadosť PO/SZCO na posúdenie, ktorá padla do posúdenia a zblblo zbliženie. Po zblížení žiadosti zblíženie nezmizlo ale stále ostalo v todo liste a každým zblížením sa vytvorilo nové ref. číslo ale žiadosť bola len na jednom ref. čísle.\r\nPo schválení žiadosti na danom ref. číslo nevzniklo číslo zmluvy ale dalo číslo zmluvy ref.čísla kde žiadna žiadosť nevznikla.\r\n\r\nviď príloha\r\n\r\nZdeno'),
