(243,1,'Cofisun','Ahojte, prosim o zadanie sara tiketu, pokial sa da do timu, kde pracuje Karin Roseleur, napriamo sa mi ju nepodarilo kontaktovat, zrejme ma dlhsiu dovolenku\r\n\r\n\r\n1. PORTFOLIO\r\nAfter yesterday is  weekly closing we have some issue in portfolio of collection. The positions were changed, but they did not change the advisor. Some of contracts in position 1 and P are still assigned to advisor of collection. \r\n\r\n2. VENTILATION\r\nIn the screen Portfolios vetilation is not possible to use filters correctly. If I choose product CAR and I want to use more than two filters, products are mixed together. It is same for Pre-recouvrement and Recouvrement.\r\n\r\n3. EXTERNAL MANAGMENT\r\nwe lost almost all contracts from external managment.The TOP is still „Externe vymahanie“, but contracts were assigned to the advisors of collection. We set external manazment with Karin Roseleur and it is  still the same, but after every weekly closing we have this problem.\r\n\r\n'),
