(251,1,'Cofisun','Ahoj,\r\n\r\nna zmluve č. 23996 a 24131 sme dňa 12.10. klientovi vygenerovali a zaslali kalkuláciu. Klienti neuhradili do termínu, a preto teraz žiadajú o vystavenie novej kalkulácie, avšak systém pri pokuse o vygenerovanie vyhodí hlášku v prílohe s názvom \"celkove splatenie1\". Na zmluve č. 22606 tiež nemôžeme vygenerovať kalkuláciu, ale z iného dôvodu - hláška v prílohe s názvom \"celkove splatenie\".\r\n\r\nĎakujem.\r\n\r\nS pozdravom'),
(252,1,'Cofisun','Ahojte,\r\n\r\nneviem, či je to chyba alebo sme to nemali vôbec zadane v špecifikácií.\r\n\r\nContract 16473 Migr. AUTO FO was in delay with last monthly instalment, due date 20.09.2018. He was in position 2 in recovery, delay was paid at 19.10.2018 and after weekly closing 12.11.2018, the position should be changed. I do not see last weekly closing and the position is still P2. Is it correctly ? In the report see atachment is the contract in position 1.'),
