(264,1,'Cofisun','Ahoj,\r\n\r\npri ručiteľovi pri sro sa nam v CFS nezobrazuje v adrese trvaleho bydliska Ulica obr1, aj keď je v zadaná obr2.\r\n\r\nDo zmluvy sa adresa doťahuje správne, pri informácii o spracúvaní osobných údajov obr3 a vyhlásení ručiteľa obr4\r\n\r\nZdeno'),
(265,1,'Ine','Ahoj,\r\n\r\nnejde sa prihlásiť do Extranetu pre retail. Neberie hesla.\r\n\r\nDal som si poslať nové heslo a neprišlo mi.\r\n\r\n\r\nZdeno'),
(266,4,'undefined','Vyskytol sa problém pri niektorých žiadostiach kedy sa zamestnávateľ neprepísal z extranetu do cofisunu. \r\n\r\nV Cofisune sa objaví alert \"technický problém pri konzultácii SSDB\", keď sa vrátime do záložky zamestnanie a vyplníme IČO a adresu zamestnávateľa po potvrdení sa údaje neuložia.\r\n\r\nV niektorých prípadoch stačilo ked sme pridali zamestnávateľa nanovo a pôvodný riadok sme zmazali, ale večer sa objavil problém kedy ani toto nefungovalo. V tomto konkrétnom prípade šlo o ref.číslo 01.281.906.101 - žiadosť sme nakoniec rozhodli tak, že sme zamestnávateľa zmenili na SZČO, inak sa to nedalo rozhodnúť.\r\n\r\nČasové rozpätie je cca od 18:49 do 19:04. \r\n\r\nPripájam print screeny z CFS.\r\n\r\n'),
(267,1,'Cofisun','Ahojte, potrebujem spárovať e-shop s extranet.cofidis, ale pri vytváraní pobočky IP mi nevygenerovalo APIKey, potrebujem pomoc'),
