(269,4,'undefined','Objavili sme problém v Extranere pri elektronickom podpise na predajni – klient má z dnešného dňa schválenú zmluvu 90371879 pričom bol zvolený elektronický podpis. Pri schvaľovaní sme museli vybrať podstav zmluvy, tak sme tam dali „Cofisun“, inak nás to nepustilo schváliť žiadosť.\r\n\r\nPredajca nás kontaktoval s tým, že klientovi neprišiel ani email ani sms s prihlasovacími údajmi do klientskej zóny pre podpis zmluvy. Údaje v žiadosti sú správne, nakoľko email o posúdení mu doručený bol.\r\n\r\nV Extranete po otvorení detailu žiadosti nie je možnosť znovu poslať prihlasovacie údaje.\r\n\r\nProsím o riešenie. Print screeny v prílohe.\r\n'),
