(285,1,'Cofisun','Ahoj,\r\n\r\nJozef robil kalkuláciu k predčasnému splateniu k zmluve 20780 a systém vygeneroval zostatkovú sumu  vo výške 2823,98 Eur. Klient zaslal vyššiu sumu vo výške 3340 Eur, ale Cofisun namiesto započítania 2823,98 Eur započítal čiastku 3296,64 Eur /3340-43,46/. Čiastka v preplatku nie je dostatočná na vyúčtovanie poplatkov a vrátenie preplatku klientovi. \r\n\r\nĎakujem.\r\n\r\nS pozdravom\r\n'),
