(293,3,'akceptacia','Problem s dopitom do crif - aktualne riesene cez kontrolny dopyt. Pri migracii chybne zmigrovane niektore FI kody osob, co sposobuje tieto chyby. Prosim o analyzu ktore osoby je ppotrebne precislovat aby boli OK a mali sme OK reporting a precislovanie. tak ako sme sa bavili\r\n\r\nDakuejm\r\n\r\nP.'),
(294,1,'Ine','Ahojte\r\n\r\ntak ideme na to. v utorok 27.11.2018.\r\nV prilohe posielam obrazok mojej plochy\r\nv cervenom ramceku su odkazy ktore viac menej nepouzivam, niektore vobec-je potrebne vyhodnotit co to je a ci to potrebujem zmigrovat. Prejdeme si to spolu prosim?\r\nv zelenom ramceku si stiahnem na kluc-to je v poho\r\nZalozky v outlooku a archiv by mi mal ostat a potom uz len zalozky z prehliadaca potrebujem nakopirovat- a nasledne obnovit na novom kompe Viem, ze sme to Dusik robili zaciatkom septembra, ale pre istotu by som to urobila este raz\r\n\r\nDakujem\r\n\r\nMaja\r\n\r\n'),
