(299,1,'Ine','Ahojte,\r\n\r\nnefunguje mi WEBI. Ak dám aktualizovať data tak sa mi to stále len načítava a nič sa nenačíta viď príloha. Skúšal som dva rôzne reporty a robí mi to u uboch a nedá sa to ani prerušiť.\r\n\r\nReštartoval som si comp a robí to stále.\r\n\r\nĎakujem\r\n\r\nZdeno\r\n\r\n'),
(300,3,'Pavlina, Miska T.. Zuzka H, Zdenko','Ahoj Dusik\r\n\r\nprosim Ta vo teste FORM potrebujem nastavit pool \"Traiter le flux en priorité”“Zpracovat tok prioritně”\r\npre Pavlinu, Misku Talandovu, Zuzku Hlivarovu a Zdenka\r\n\r\nJa som to pozerala ale neviem to najst\r\n\r\nTusim,ze tento pool sme dalavali Janke Galfy a mozno aj ludom z CC\r\npozries sa na to prosim, ci to vieme my, alebo je nutne vytvorit SARA?\r\n\r\nDakujem\r\n\r\nMaja'),
(301,1,'Cofisun','Ahojte.\r\n\r\nVolal Rišo Rakyta ohľadom schválenej zmluvy 50018204, predajcovi AAA LM sa nedala stiahnuť zmluvná dokumentácia, vypísalo im to chybu.\r\n\r\nKeď som si zmluvu chcela otvoriť v CFS tak mi zobrazilo prázdny dokument viď. print screen nižšie. Po opätovnom pokuse zobraziť zmluvu to vypísalo ďalší alert problém pri obnovení súboru - print screen v prilohe.\r\n\r\nProsím o preverenie a spätnú informáciu.\r\n'),
(302,1,'Cofisun','Ahojte, natrafili sme na nasledovnú vec:\r\n\r\nDo extranetu prišla žiadosť, pričom v komunikácii v extranete je komentár „technická chyba pri komunikácii s Cofisun“, ale žiadosť sa nám do CFS prepísala a to dokonca dvakrát to isté referenčné číslo, dve rôzne čísla zmlúv  90376079 a 90376097 – po rozkliknutí sa ale v karte klienta nachádza iba jedna žiadosť - 90376097.\r\n\r\nCrif nám vypísal chybu „kód záznamu pridelený klientovi je pripojený k inému záznamu“ poslali sme to Barbore. \r\n\r\nV prílohe posielam print screeny.\r\n'),
(303,1,'Cofisun','Ahojte.\r\n\r\nPri nižšie uvedenej žiadosti nie je uvedené číslo zmluvy v CFS, pričom na vygenerovanej zmluve to vyzerá byť ok. Ani po schválení zmluvy sa číslo zmluvy nedotiahlo ani sa podľa neho zmluva nedá v Cofisune vyhľadať.\r\n\r\nPri vyhľadaní podľa „spoločnosť-meno“ a zadaní priezviska „Pálik“ nám to vyhľadá 3 záznamy / 3 rôzne referenčné čísla viď. print screen v prílohe, pričom po rozklinutí riadku s číslom zmluvy 60008943 sa v zložke nezobrazuje žiadna žiadosť. Naopak po rozkliknutí riadku s číslom zmluvy 60008934 sa ovorí zložka so schválenou žiadosťou ale nezobrazeným číslom zmluvy. Po otvorení zmluvy v danej zložke klienta je na nej číslo 60008943.\r\n\r\nProsím o preverenie danej situácie.\r\nĎakujem.\r\n'),
(304,1,'Cofisun','Ahojte.\r\n\r\nDo ToDo listu nám dnes padla 3x žiadost klienta z referencie 01.290.469.101 Dagmar Stefany Pavlíková cez eshop dormeo.sk, pričom v extranete sa táto žiadosť nachádza stále v stave „rozpracované.\r\n\r\nV Cofisune máme aktuálne 1 priamo odmietnutú a 3 zastavené.\r\n\r\nKeď som si pozrela komunikáciu v Extranete tak tam boli nasledujúce údaje viď print screen v prílohe.\r\n\r\nNeviem kde nastal problém. Prosím o preverenie, či sa tam neudialo niečo čo by nemalo.\r\n'),
