(333,4,'undefined','Ahoj,\r\n\r\nžiadateľ o úver, ktorý je v CFS pod ref. č. 01.291.747.101 zaslal odvolanie súhlasu so spracúvaním osobných údajov.\r\n\r\nŽiadosť bola zadaná cez eshop a bola stornovaná pred podpisom. Analýza mi potvrdila, že klient prešiel cez súhlasy so spracúvaním osobných údajov, avšak mi nedokážu zistiť, či udelil súhlas so zasielaním marketingových ponúk.\r\n\r\nProsím o informáciu, či klient udelil súhlas aj s MKT alebo nie pri vypĺňaní žiadosti. Túto informáciu potrebujem, aby som vedela korektne spracovať odvolanie súhlasu a pripraviť adekvátnu odpoveď pre klienta.\r\n\r\nĎalej prosím o informáciu, po akej dobe sa žiadosť z Extranetu vymaže.\r\n\r\nVopred ďakujem za informáciu.\r\n\r\nB.'),
(334,1,'Cofisun','Ahoj\r\n\r\nna zmluve 60008837 nám vyskočila divný dátum prevej splátky viď príloha 30/12/2018.\r\n\r\nV cofisane po odfinancovaní nebol ani vyplnený dátum 15. Druhá strana prílohy horný rámček. Ten som tam doplnil až následne dúfajúc že sa posunie dátum ale posunul sa až od druhej splátky ale posunul sa dátum zrážok nie dátum splátok. \r\nPozriete sa na to kde sa mohla stať chyba, keď máme napevno nastavený dátum splátok vždy k 15.\r\n\r\nĎakujem\r\n\r\nZdeno'),
