(339,2,'Notebook','Ahoj Dusik, Edo\r\n\r\nprosim Vas , zariadite notik na uctaren pre Paliho?\r\ndovod je, ze Pali chce mat raz mesacne ho\r\n\r\nDusik mi pisal do emailu: \"                 >> treba ho len nastavit nech sa vytvoria zalozky na ploche \"\r\n\r\n\r\nCo navrhujete? nechame ho tam non stop, alebo ho nechame u nas a bude si pre neho k nam chodit? ze to bude \"shared\" notas\r\n\r\nDakujem\r\n\r\nMaja'),
(340,1,'Multicash','Ahojte,\r\n\r\nmam problem s pripojenim do multichashu - len tatrabanka, vub mi ide.\r\nHelp desk TTB identifikoval problem na nasej strane, mam bloknuty port.\r\n\r\nJe to naozaj urgentne, nemozeme financovat.\r\n\r\nDakujem krasne,\r\n\r\nm'),
(341,4,'undefined','Prosím ťa, vedela by si preveriť schválenú zmluvku 90378234 – pôvodne šlo o elektronický  podpis zmluvy z eshopu podľa extranetu, ale dnes sme dostali od klienta podpísanú zmluvu poštou a v Cofisigne ju vôbec nenachádzame ani v zozname žiadosti na podpis u klienta, ani v archíve. \r\n\r\nV archíve je len zmluva 90370796, ktorú klient podpísal a bola podpísaná aj z našej strany, ale potom klient v eshope objednávku aj žiadosť o úver zrušil a bola stornová aj u nás v extranete aj v cofisune.\r\n\r\nV komentároch nemáme žiadne info, či bol nejaký technický problém s elektronickou zmluvou.  Jediný rozdiel, ktorý som našla medzi stornovanou a schválenou  žiadosťou je v extranete v komentároch, viď print screeny\r\n\r\n-	Pri zmluve 90370796 stornovaná je v komentároch „odoslanie sms s prihlásením“ a „odoslanie emailu s prihlásením“\r\n-	Pri novej zmluve 90378234 aktuálna je v komentároch len „odeslán email zákazníkovi – schválenie žiadost“ a „odoslané sms zákazníkovi – schválenie žiadosti“\r\n\r\nMne to pripadá, ako keby sa v klientskej zóne nevytvorila zmluvná dokumentácia, ale potom zase neviem odkiaľ si klient  vytlačil zmluvu...\r\n'),
(342,4,'undefined','Znova sa nám status pri niektorých schválených žiadostiach zmenil na \"chybu v dokladoch\", aktuálne máme info z klientskeho ohľadom schválenej žiadosti 90379707 Marian Saloci - klient poslal email, kde píse: \"dobrý deň prajem neviem sa prihlásiť lebo mi stále ukazuje vnútorná chyba systému\"\r\n\r\nV prílohe posielam print screen emailu od klienta a tiež print screen s aktuálnymi žiadosťami v stave \"chyba v dokladoch\" z extranetu všetky boli normálne schválené, nie je s nimi žiadny problém.\r\n\r\nProsím o preverenie a opravu.\r\n\r\nďakujem'),
(343,4,'undefined','máme tu ďalšiu zmluvku, ktorá  bola schvaľovaná pre kamennú predajňu s elektronickým podpisom, pričom zmluva sa nenachádza v klientskej zóne - v archíve esignu sme klientku našli, ale žiadne dokumenty tam nemá.\r\n\r\npripájam print screeny, podľa extranetu to vyzerá, že jej tiež vôbec neboli odoslané prihlasovacie údaje do klientskej zóny\r\n\r\nprosím o preverenie\r\n\r\nďakujem.'),
