(347,3,'Katarina Vrabkova','Ahojte Ahojte\r\n\r\nKatka Vrabkova je dnes posledny den v praci. do 16:00 este normalne pracuje\r\n\r\nProsim Vas od zajtra 13.12.2018 je potrebne ju zrusit ako usera- user Cofidisu, outlook, z EISECU ju zrusim ja-len mi to prosim pripomente.\r\nA neviem kde vsade ju este je potrebne zrusit\r\n\r\nDakujeeeeeeeeeeeeeeeeem\r\n\r\n\r\nMaja'),
