(350,1,'Cofisun','Hello,\r\n\r\nwe have issue with charging late fee in collection process.\r\n\r\nConditions of calculation of the fee should be following:\r\n\r\nLate fee 20€ will be calculated only if both conditions are fulfilled\r\nFirst condition: at the weekly closing the position has changed from P1 to P2\r\nSecond condition: at the monthly closing the position of the contract is P2\r\nNo late fee is calculated on contract in position 3 only manually\r\n\r\nActually we have two main problems:\r\n1 no fees are not charged for contracts in position P2\r\n2 for four contracts in position P3 was charged fee 20€ contracts: 21308, 24667, 21820, 22695\r\n\r\nWe need to charge the fee only when position is changing from position 1 to position 2.\r\n\r\nCould you check the settings please ?\r\n\r\nJG\r\n\r\n\r\n\r\n\r\n\r\n'),
