(372,1,'Cofisun','Ahoj,\r\n\r\npoprosím o zadanie požiadavky do Francúzska na opravu trhovej ceny vozidla zo 65.000.000 eur na 65.000 eur viď príloha, ktorý to je údaj\r\n\r\nTýka sa to zmluvy č. 60011693\r\n\r\nZdeno'),
(373,1,'Cofisun','na  zmluve 18203 sa zrealizovalo v 11/2018 ciastocne predcasne splatenie kvoli vyssej uhrade klienta, ale klient len hradil dlh + poplatky inkasnej agenture, potrebujeme vratit do povodneho stavu\r\n\r\nKlient uhradil v 11/2018 sumu 593, v tejto sume boli dlzn ciastka za mesiac 8,9,10,11/2018+ poplatok za inkasnu agenturu 150€\r\nPotrebujeme aby splatka bola opat v sume 118.02€\r\n\r\nzadany tiket SA0000037370041\r\n'),
(374,1,'Cofisun','Ahoj,\r\n\r\nna zmluve č. 22908 Braňo zrušil zápočet na predčasné splatenie, aby sa uhradená splátka započítala do plánu. Splátka sa však započítala na splátku splatnú dňa 20.12.2018 vo vyššej výške ako je očakávaná, a preto prosíme o opravu. Správne by mala byť na splátke k 20.12. zaplatená suma 310,35 Eur a zvyšok by mal byť priradený k splátke  splatnej 20.1.2019. Na splátke k 20.1.2019 by mala byť po oprave suma 241,04 Eur, to je suma, ktorá bola na preplatku pri migrácii.'),
(375,1,'MicrosoftOffice','Ahoj,\r\n\r\nnaša mailová schránka informacie@cofidis.sk sa automaticky vymazáva po 3 dňoch. Prosím o archiváciu týchto dokumentov, aby sme sa k nim mohli dostať aj neskôr. Nakoľko, ak sa dokument nenahrá do \"TO DO Listu\", už sa nevieme k nemu dostať, ani zistiť, či bol doručený. \r\n\r\nĎakujem.\r\n\r\nS pozdravom'),
