(382,3,'Antonia Zabojnikova','Potrebujem na autách otestovať preradenie splátky medzi zmluvami. Medzi retailovými zmluvami je to jednoduchý proces – preradenie, ale pri autách sú pravidlá niektorých operácií odlišné. V manuáli sa konkrétne o preradení medzi klasickými zmluvami nič nepíše, tak to musím najskôr otestovať. A keďže v testovacom prostredí sa nedá urýchliť spracovanie operácie, potrebujem, aby sa v ten deň neprepísali údaje. Jedná sa konkrétne o preradenie medzi zmluvami 50020369 a 50021901.\r\n\r\nEšte by som potrebovala vedieť, v akom prostredí to môžem otestovať. Peťa niečo spomínala, že v obvyklom testovacom prostredí je FORM SK je testovanie dočasne pozastavené.\r\n'),
