(518,4,'undefined','Ahojte,\nv piatok 1.3.2019 sme partnerovi Ivan Sekáč odfinancovali dve zmluvy. \nZmluvu č. 50037835 v sume 4000 EUR a zmluvu č. 50036423 v sume 15500 EUR. \nCelková suma financovaných zmlúv pre partnera, ktorý má nastavenie \"globally\" (suma za všetky financované zmluvy odchádza jednou sumou) bola 19500 EUR.\nPartnerovi Ivan Sekáč odišla od nás platba len v sume 7450 EUR.\nPartner Ivan Sekáč nemá u nás nastavené predfinancovanie, takže sa mu financovaná čiastka nezapočítala s vyplatenou zálohou.\nV prílohe posielam časť batchu č. 9431 zo dňa 1.3.2019, na ktorom je rozpis financovaných zmlúv.\nV batchi je uvedené, že suma na účet partnera je 7450 €UR a poznámka \"CHECK SUM KO!!!: SUM = 19500 EUR\", ktorej nerozumiem.\nMôžete, prosím, preveriť, prečo partnerovi Ivan Sekáč odišla od nás platba len v sume 7450 EUR a čo znamená poznámka \"CHECK SUM KO!!!: SUM = 19500 EUR\"?\nPýtala som sa aj na anylýze, ale obidve zmluvy odfinancovali obvyklým spôsobom.\nPartner Ivan Sekáč rozdiel v sumách financovaných zmlúv a čiastky, ktorú sme mu poslali na účet, reklamuje a je dosť netrpezlivý.\nVopred vďaka.\nTonka'),
