(567,4,'undefined','Ahojte,\nprosím o premenovanie disku, na ktorom je accounting, resp. o zosúladenie pomenovania pre celé oddelenie. \nMomentálne máme tento disk označený ako Z alebo ako Y.\nProblém nám to spôsobuje vtedy, ak nahrávame skeny faktúr do Heliosu a ak sken uloží kolega, ktorý má disk označený Z a chcem si ho pozrieť ja, ktorá mám disk označený Y, tak to nie je možné.\nJe dosť možné, že taký istý problém vznikne pri schvaľovaní dokladov v Heliose.\nVopred vďaka.\nTonka'),
(568,1,'Cofisun','Ahojte,\nMôžete, prosím, napísať do FR, aby vo FORME (EISEC CLIENT FORM-SK) urýchlili spracovanie operácie „platba“ na zmluve 60001317 (viď príloha)?\nZároveň by ste sa mohli opýtať, ako sa dá anulovať „prime réemploi“ bez toho, aby sme zrušili celé predčasné splatenie?\nVopred vďaka.\nTonka'),
