(576,4,'undefined','Hello. \n\nDuring the control we found out few client with more references. We need to merge client is  references to one reference for each client. Merging parameter is PIN (Birth number, in database individu.ind_nrn).\n\nOur recommended merging algorithm will be:\n\n1. the oldest reference will be used \n2. data from newest reference will be transferd to the oldest reference\n3. If some data is missing in the newest reference use data from oldest \n4. All other references will be deleted\n\nExample from the file. \n\nClient: MIlan ČEPEC, PIN = 5612166571\n\nTwo references 00.835.495.101 , 01.143.651.101.\n\nFinal status after merge. \n\nOnly one reference 00.835.495.101 with two products number 900026408 and 18633 and with data from reference 01.143.651.101.\n\nFrom more question plese contact me. We are open to discusion about the possibilities of merge.\n\nThank you \n\nSG'),
