(586,1,'MicrosoftOffice','Dobrý deň, \n\nprosím o vyriešenie problému s nastavením mojej elektronickej pošty. \n\nV prípade, ak zasielam aktualizácie platieb externým inkasným agentúram, je im doručený excelovský súbor ako ZIP. Pričom som zasielala dnes ako test ten istý súbor, ktorý zasielala Marcelka Trnavská bez nejakej zmeny formátu alebo podobne a z jej emailovej schránky bol email odoslaný bez toho, aby sa to zmenilo na ZIP, žiaľ u mňa sa to zmenilo. Inkasná spoločnosť to potom nevie otvoriť. \nProsím o preverenia nastavenia - outlook pošta. \n\nĎakujem veľmi pekne.\n\n \nV prílohe email od pani Pačesovej z inkasnej spoločnosti, v ktorom je printscreen, z ktorého je možné vidieť, ako im je to doručené. \n\n\n '),
(587,1,'Ine','Dobrý deň, \n\nprosím o pomoc s inštaláciou aktualizácie e-slovensko, nakoľko aj v minulosti bez vašej ingerencie nebolo možné, nakoľko požadovalo nejaké nastavenie/heslo, ktoré neviem zabezpečiť. \n\nBez aktualizácie neviem vstúpiť do schránky. \n\nďakujem veľmi pekne. '),
