(591,4,'undefined','Ahojte.\n\nPo patrani som zistil nasledovne chyby.\n\nPre CD nemame implementovane kritecia DTI xue_146066, integracia budgetu xue_146037.Je tam implementovane kriterium budgetu xue_146041 ale je REFUSE namiesto COMP. COFIDIS. \n\nJe chybna priorita zamietania dovodov. pri dem_idt = 251241,251954,252135,252187 sa jednalo o budget mal byt priradeny dovod zamietnutia 3. nie 1 uverovy register.\nPri dem_idt = 251983 mal byt priradeny dovod zamietnutia Interne kriteria banky. \n\nTreba implementovat kriteria DTI a integraciu budgetu za konzultaciu a vyhodnotenie CRIFu. Treba zmenit budget na COMP. Cofidis. Treba zistit preco sa zle priraduju dovody zamietnutia. Vo vela pripadoch sa CRIF ani nespravil. \n\nS pozdravom \n\nSG \n\n '),
(592,3,'GROMST','Ahojte.\n\nNejde prihlasit na nasledujuce linky do NBS \n\nhttps://rbuz.univerzal-net.sk/login/?next=/\nhttps://rbuz3.univerzal-net.sk/login/?next=/\n\nprosim preverit pripojenie na nasej strane. Vcera som bol prihlaseny. Je to urgentne. \n\nDakujem \n\nSG '),
(593,3,'Andrea Zábojníková, Patrik Hržič','Ahojte, prosím vytvoriť prístupy pre:\nAndrea Zábojníková, nástup 1.4., Poradca KLIS, ref. user Sivlia Kufčáková, na špeci prístupy a pripravenie pracovnej stanice sa prosím pýtajte Zuzky Hlavenkovej.\nPatrik Hržič, nástup 1.4. Uverový analytik, ref. user: Geschvantdner, na špeci prístupy a pripravenie pracovnej stanice sa prosím pýtajte Zdenka Hrabovskeho\n\nVopred Ďakujem\n\nK.'),
(594,3,'Hlavenková','Prosím o pridelenie práva na zrušenie chybnej poznámky v Cofisune. Janka Galfyová toto právo má, aby som ju nemusela stále otravovať.\n\nĎakujem.\n\nS pozdravom\nzh'),
(595,1,'Ine','Ahojte,\n\nzmluva 90412277 je eshopova zmluva s esignom, a klientovi prisiel mail aby poslal zmluvy ku nam na spoločnosť???\n\nTo nie je najvačší problém.... klientovi sa vracala zmluva späť na podpis aby vložil VBU, tak urobil ale je to stale u neho na podpis.\n\nSom ho poprosil aby poslal printscreeny ale nebol ochotný a je dosť nasr....\n\nPoprosím o čo najrychlešie doriešenie daného prípadu lebo mam pocit, že bude z toho pekny pruser.\n\nPosialm aj veci v prílohe\n\nĎakujem\n\nZdeno'),
(596,1,'Cofisun','Dobrý deň, dnes som si kontrolovala todolist a mám tam záznamy, ktoré nepatria na moju osobu,ale na kontaktné centrum a mám tam cez 1500 záznamov, ktoré sa netýkajú mojej osoby. \n\nProsím o nápravu. \n\nĎakujem veľmi pekne. '),
(597,2,'Ine','pridanie prav uzivatelke NETIKOLE do controlling priecinku'),
(598,1,'Cofisun','Klient zo zmluvy č. 21435 má účet vedený v BKS banke, ktorú systém Cofisun nevie identifikovať. Cofisun účet uložil, ale názov banky je uvedený \"neznámy\". Vrátenie preplatkov prebehlo štandardne, ale do multicashu účet neprešiel, namiesto čísla účtu tam bolo uvedené číslo 101 a na financiách museli súbor ručne upraviť. V prílohách preposielam komunikáciu a printscreeny. Prosím o zavedenie BKS banky do Cofisunu, aby sa tento problém odstránil do budúcnosti. \n\nĎakujem.'),
(599,1,'Cofisun','Ahojte,\n\nfinancovali sme zmluvu 71092178. Kde sme pri vytvorení financovania dali odmietnuť financovanie, lebo sme chceli zmeniť číslo bankového účtu.\n\nZmenili sme potom číslo BÚ v systéme a pôvodné sme vymazali, ale teraz keď chceme vytvoriť nové financovanie nezobrazuje číslo BÚ, viď príloha a nedá sa tak financovať.\n\nPoprosím o rýchlu odpoveď lebo klient nás naháňa ohľadom financovania.\n\nĎakujem\n\nZdeno\n\n'),
