(603,4,'undefined','Ahoj,\n\ndňa 21/02/2019 mali byť nasadené nové hodnoty Priemernej RPMN do SECCI. Pri kontrole zmlúv schválených po tomto termíne, nesedí priemerná RPMN v porovnaní so súborom:\n\n2019_Vypocet sazeb_urokove stropy uloženom na \\\\Uf61sb03\\vp_all\\Zmluvná dokumentácia\\priemerna RPMN a urokove stropy\\od 21022019\n\nOkrem toho pri niektorých kontraktoch nesedela ani RPMN na stotiny %.\n\nVýsledky kontrol posielam v prílohe - v záložkách komentár je uvedená správna hodnota vs. hodnota na zmluvách.\n\nĎakujem za analýzu a prípadné odstránenie problému.\n\nB.'),
