(605,4,'undefined','Ahojte,\n\nvzhladom na to, ze od marca mame pouzivat v komunikacii cisla uctov na auta, tak by bolo potrebne zmenit cisla uctov aj na retailovych vypisoch\n\nNove cisla uctov:\n\nTatra banka: SK43 1100 0000 0020 0700 8979\nVÚB banka: SK04 0200 0000 0020 7914 7054\n\nv prilohe vyznacujem, kde sa moze vyskytnut cislo uctu.\n\nJ.\n'),
(606,1,'Cofisun','Ahojte, \n\nprosím o zadanie ticketu, klient má tento mesiac možnosť splatiť úver bezúročne 90298638, 90299117, avšak v syntéze sa neukazuje výška doplatku k bezúročnému doplateniu. Podmienky splnené sú. Kod produktu je PN12 2. '),
