(608,2,'Deskphone','Ahojte,\n\npoprosim o preverenie vypadkov telefonov, ktore sa od 12.tej opakovane restartuju.\nNa prevadzkach takto nemozeme pracovat. Poprosim aspon priblizny cas s ktorym mame ratat.\ndakujem'),
(609,1,'Cofisun','Ahoj,\n\npri komunikácii s EISECom som sa informovala na možnosť zadávania zahraničných bankových účtov do EISECu. Bolo mi povedané, že je to len otázka nastavenia a Slovensko má povolené zadávať len SK bankové účty, keďže sme nikdy nežiadali o umožnenie zadávať zahraničné BÚ.\n\nVzhľadom na to, že naši obchodní partneri ale aj niektorí klienti aktívne využívajú zahraničné bankové účty, chcela by som požiadať o zmenu nastavenia EISECu a teda o spustenie možnosti zadávať zahraničné bankové účty.\n\nAj napriek tomu, že mi povedali v EISECu, že by sme si mali požiadať o toto nastavenie prostredníctvom RUBIS ticketu, chcela by som Vás požiadať o zadanie SARA ticketu, keďže by malo ísť o nastavenie a nie vývoj.\n\nĎakujem,\nB.'),
(610,2,'Deskphone','Ahojte,\n\nnedá sa nám volať na mobilné tel. čísla začínajúce na predvoľbu 0909 (operátor JURO).\n\nPoprosím aj o kontrolu ostatných predvolieb mobilných operátorov pre istotu :-) \n\nĎakujem\n\nZdeno\n\n'),
(612,1,'Cofisun','Hello,\n\nplease we would like to change advisor on the contract 19131 from Juraj Kantorek to Zuzana Hlavenkova.\nWe do not have possibility to change it manually.\nThanks\n\nBr.'),
(613,1,'Cofisun','Klient odstúpil od zmluvy do 14 dní od financovania a preto som chcela zmluvu zadať do pozície D. Po zadaní mi vyhodilo hlášku v prílohe. Preklad je \"prosím, zrušte ešte splatné poplatky\". Na zmluve je už očakávaná splátka splatná k 15.4.2019, ale žiadny poplatok. Prosím o zadanie do pozície D, aby zmluva nespadla do vymáhania, kým čakáme na vrátenie financovanej čiastky od predajcu.'),
(614,1,'Cofisun','Ahojte, \n\nprosím o vyziadanie info z fr, ci sa jedna o chybu v nastaveni listu alebo problem s odoslanim listu suvisi s poziciou P v ktorej sa klient prave nachadza. Vid printscreen'),
(615,1,'Cofisun','Ahoj,\n\nprosím o zrušenie predčasného splatenia z januára 2019. Úhrady vo výške 271,43 EUR z 5.2.2019, 4.3.2019 a 3.4.2019 sú zaúčtované na poplatok za predčasné splatenie. Prosím o zrušenie poplatku a zaúčtovanie na splátky.\n\nĎakujem.\n\nS pozdravom'),
