(618,1,'Cofisun','Ahoj Maji,\n\nako som Ti ráno spomínala, prepisujú sa nám adresy do EISECu tak, že popisné a orientačné číslo sa prepíše len do popisného. Robí to problém, keď je napr. vytvorená nebezpečná adresa, ktorá je vyplnená správne (číslo popisné je v kolónke \"N°\" a číslo orientačné v kolónke \"Č.or.\"), tak v prípade, keď je uvedené číslo popisné aj orientačné len v kolónke \"N°\", tak nám tieto adresy nechytí.\n\nV prílohe posielam náhľad takto prepísanej adresy.\n\nZ pozorovania som si všimla, že by to mal byť problém len pri autách, pretože v NESSovom Extranete sú vytvorené kolónky pre jednotlivé údaje.\n\nĎakujem za preverenie a prípadné vyriešenie.\n\nB.'),
