(620,1,'Cofisun','Ahojte,\n\npri zmluve 50046754 (ref.číslo 01.367.454.101), je v systéme zle načítaná výška splátky (viď príloha)\n\nNa zmluve je poistenie Light, výška splátky na PDF zmluve je uvedená správne 178.20 EUR čo je výška aj s poistením ale v systéme načítalo splátku bez poistenia 175.05 EUR a túto výšku splátky načítalo aj do vstupného listu,\n\nDáte to prosím opraviť v systéme aby to bolo korektné, ďakujem\n\nV prílohe zasielam printscreeny\n\nZdeno'),
(621,4,'undefined','Ahojte,\nmohli by ste, prosím, do našej tlačiarne  ECOSYS M6026cdn objednať tonery? Teraz je nás v kancelárii viac, a rýchlejšie sa míňajú.\nObjednajte nám všetky farby: modrú, červenú/ružovú, žltú a aj čiernu.\nVopred vďaka.\nTonka'),
(622,3,'Andrea Zábojníková','Ahoj,\n\nprosím o prístup, prihlasovacie meno a heslo do NEOGENIE - zákaznícky servis pre Andreu Zábojníkovú.\n\nĎakujem.'),
(623,4,'undefined','Ahojte.\n\nPotrebuejm aby ste zadali RUBIS. DA60 - connected to SARA: SA0000038071670\n\nWe want to implement xue_146037 before CRIF consulatation to have visualization of the budget also before CRIF consultation. Sometimes implementation only after the CRIF consultation is too late for acceptation line. They need to see budeget visualization also before CRIF.\n\nThank you for analyse this request \n\nBest regards \n\nSG'),
(624,4,'undefined','Prosím o opravu splátok v EISEC pri týchto zmluvách:\n\n90411478 - contract 26,18 / eisec 26,19\n90413545 - contract 73,24 / eisec 73,25\n90411185 - contract 24,19 / eisec 24,20\n90414247- contract 26,18 / eisec 26,19\n\nĎakujem.\n'),
(625,1,'Ine','Ahoj, \n\nz 31.3. na 1.4.2019 sa mali ukončiť zmluvy do pozície \"i\" a dňa 1.4.2019 nám mal prísť mail ako je v prílohe. Mail nám neprišiel, prosím o prešetrenie.\n\nĎakujem.\n\nS pozdravom\n\nZuzana Hlavenková'),
(626,3,'Eva Paulíková','Ahojte, \nprosím o vytvorenie užívateľa a prístupov pre Eva Paulíková, Poradca klientskeho servisu.\nRef. user je Silvia Kufčáková, viac info o sedení a potrebných lokálnych prístupoch Vám dodá Zuzka Hlavenková.\n\nĎakujem\n\nK.'),
(627,1,'Cofisun','Ahojte,\n\nobchodný partner Autorenta BB dnes reklamoval, že od nás nedostali peniaze za financovanú zmluvu č. 50048733.\n\nZmluva bola financovaná dňa 9.4.2019, ale v súbore na financovanie sa neobjavila.\n\nNa obchodnom oddelení skontrolovali nastavenie partnera a sú v poriadku. Navyše sa nejedná o nového partnera a v tomto mesiaci už mal financovanú inú zmluvu. Na akceptácii som overila, či sa pri financovaní tejto zmluvy nevyskytol nejaký problém, ale žiadny nezaregistrovali.\n\nV chaine zo dňa 9.4.2019 sa táto zmluva vyskytuje, suma úveru je 7622 EUR (vrátane spracovateľského poplatku), ale suma na úhradu je 0 EUR. V EISEC je uvedené, že suma úveru je 7 400 EUR. \n\nMôžete, prosím, napísať do FR, aby preverili, kde sa stala chyba?\n\nVopred ďakujem.\n\nTonka'),
(628,1,'Cofisun','Ahojte,\n\nna zmluve  90401323 potrebujeme upravit ocakavanu ciastku.\nFinancovana ciastka odisla partnerovi na ucet a kedze nam nenahlasil novy ucet, financie sa nam vratili, ale priamo na zmluvu klienta, opatovne sme preposielali financie partnerovi, ale klienta sme dostali touto transakciou do  minusu.\n\nPotrebujeme aby klient mal v ocakavanej ciastke len mesacnu splatku za april 65.51€. \nA opravili sme mu poziciu a znamku na P1N1(advisor Held)\n\ndakujem'),
(629,1,'Cofisun','Dnešného dňa som cez ventiláciu dávala klientov pod externé agentúry, pričom mi zakaždým klientom, čo som dala pod agentúru a potvrdila ho vypisovalo: \"Impossible de créer le fichier récapitulatif des contrats en contentieux externe\", čo by malo znamenať nejakú nemožnosť to vytvoriť. \n\nNakoniec mi však tých klientov dalo pod externé agentúry, ale na niektorých mi vytvorilo viacnásobné topy.\n\nOVER LEASE  ZMLUVY \n\n21349\n22364\n22910\n25093\n25683\n\n\nMABORO  ZMLUVY\n\n18018\n20016\n20683\n22867\n24535\n24667\n24759\n25340\n25580\n25616\n\nProsím o preverenie, čo je s ventiláciou a prečo túto hlášku vypisuje a prečo robí viacnásobné topy. \n\nĎakujem veľmi pekne. \n\nBibiána'),
(631,4,'undefined','COFIDIRECT - pri predschválenej zmluve 71096544 systém nevygeneroval zmluvnú dokumentáciu, po otvorení je pdf prázdne (printscreen v prílohe).\n\nprosím o nápravu\n\nďakujem'),
(632,4,'undefined','Ahojte.\n\nProsim zmenit nastavenia veku pre vsetky produkty jednotne. \n\nMinimalny vstupny vek 18r\nMaximalny vstupny vek 70r\nMaximalny vystupny vek 75r.\n\nZmena sa jedna o vsetky produkty, ktore mame. Vek je na nastaveniach produktu.\n\nS pozdravom \n\nSG'),
(633,3,'tomas vasil','ahoj, rad by som aby Danka vedela posielat v mojom mene maily, ale citat moje maily nie :-)\r\ndik za preverenie\r\nt'),
(634,4,'undefined','Ahoj,\nchcela by som sa informovať, ako to v skutočnosti je s TOPom MKT Consentant.\n\nPodľa emailu, viď. príloha, by mal fungovať následovne:\n\n1.	Vytvorí sa žiadosť v Extranete;\n2.	Po zaškrtnutí check boxu so súhlasom sa prepíše automatický TOP do EISEC s tým, že keď si klient rozklikne súhlas a zaškrtne tam, že súhlasí s MKT, tak sa do EISEC prepíše motiv „NIE“, keď to nerozklikne alebo zaklikne, že nesúhlasí s MKT, tak je motiv „ANO“;\n3.	TOP sa zadáva automaticky už pri žiadosti (neviem presne v ktorom kroku), predpokladám, že keď je žiadosť v Extranete kompletná a preklápa sa do EISEC.\n\n\nAvšak tu mám prípad, kedy som pri spracúvaní žiadosti o výmaz OÚ zistila, že v Informácii o spracúvaní OÚ je uvedené, že súhlasí s MKT, viď príloha, ale prepísal sa TOP MKT Consetant s motivom \"ANO\" (čo má znamenať, že súhlas nemáme).\n\nProsím pridať do komunikácie T. Vasila a D. Kapitáňovú, aby sa vedeli do budúcna definovať kritéria pre MKT selekcie.\n\nĎakujem.\nB.'),
(635,3,'Eva Paulíková','Prosím o zriadenie prístupu pre Evu Paulíkovú do počítača, Cofisunu, zdieľaného foldru, Neogenie  a Extranetu.\n\nĎakujem.\n\nS pozdravom'),
(636,3,'Andrea Zábojníková','Prosím o prístup pre Andreu Zábojníkovú do Extranetu a do GED programu - poistenie ACM.\n\nĎakujem.'),
