(639,1,'Cofisun','Ahoj,\n\npri financovaní Braňovi zamrzol EISEC a keď chcel následne zmluvu (90416012) odfinancovať tak mu to nešlo a vyhodilo mu hlášku \"Stav žiadosti nepovoľuje túto operáciu\", viď príloha.\n\nSkúšal som to aj jaj a hodilo mi rovnakú chybovú hlášku.\n\nZdeno'),
(640,3,'Eva Paulikova','Ahoj,\r\n\r\nprosím o opravu. Eva Paulíková sa nevie dnes prihlásiť so včera zadaným heslom do počítača. Vypisuje jej, že zadala nesprávne meno alebo heslo.\r\n\r\nĎakujem.\r\n\r\nS pozdravom\r\n'),
