(646,1,'Ine','Ahoj, pri nahadzovaní zmluvy vyhadzuje technicku chybu, /nám aj klientom/, že treba vyplniť všetky červené polia, aj keď tam žiadne červené pole nie je. Systém nás nechce pustit za osobne udaje, aby sme vyplnili ďalšiu časť.'),
