(648,4,'undefined','Hello.\n\nDirung regulary control we found the incorrect calculation of reserve in budget. NTimes contract number (cnt_idt_as)  90413216. \n\nI check specification of calculation xue_146037 budget integration. \n6)	Integration of Reserve budget\n\nSearch incomes (borrower and coborrower)\n\nIf actual Reserve budget > 0\ni.	End date on actual Reserve budget\nii.	Create on new Reserve budget : (incomes_borrower + incomes co-borrower - RB_LWA – RB_LWAI - RB_LWCH * number of dependent children) * RB_CP	\nElse (actual Reserve budget = 0)\niii.	Create on new Reserve budget : (incomes_borrower + incomes co-borrower - RB_LWA – RB_LWAI - RB_LWCH * number of dependent children) * RB_CP\nEnd if\n\n\nIn calculation RB_LWCH * number of dependent children is missing. Can you explain me this situation ? If I use my testing calculator the reserve is calculated (700 - 206-188) * 0.2 = 61.2 \n\nThank you.\n\nSG'),
(649,1,'Cofisun','Dobrý deň prajem, \n\nklienti čísla zmlúv: \n18496\n22734\n20973 \n\nnie sú v zozname zmlúv vo ventilácii, potrebujeme ich dať do skladu a nevieme.\n\nprosím o ich doplnenie do zoznamu.\n\nďakujem veľmi pekne. \n\nBD'),
(652,3,'Hlavenková','Ahoj, bolo mi pridelené právo na výmaz poznámky a nefunguje mi to. Prečo? Som prihlásená v EISEC Client PROD.\n\nĎakujem.'),
(653,1,'Ine','Ahoj, \n\nvolal pán Štefan Novotný, že sa zasekol pri nahadzovaní žiadosti cez web. Nevedel pokračovať v žiadosti aj keď vyplnil všetky polia. Skúsila som nahodiť aj ja a tiež som sa zasekla pri zadávaní zamestnania. Posielam printscreen obrazovky, boli vyplnené všetky polia, ale keď som dala pokračovať, systém ma nepustil ďalej a ani nič nevypísal. Pole zdroj príjmu sa vyžltilo, aj keď bolo vypísané. Len taký nápad, možno je to blbosť, či sa tam náhodou \"nebije\" obchodný zástupca a zamestnanec. \n\nPár minút predtým som nahodila inú žiadosť bez problémov. \n\nKlient skúsi ešte zajtra a ak sa mu nepodarí, zavolá nám.'),
(654,2,'Ine','Ahoj.\n\nProsim o mobilny telefon s pristupoma na maily. Je to nariadenie CODI. \n\nS pozdravom\n\nSG'),
(655,1,'Cofisun','Dobrý den, prosím o zadání ticketu do EISEC na vymazání zbývajících late fees, které byly starým systémem kalkulovány chybně.\nStejný ticket jsme řešili už ve februári - SARA ticket SA0000037716860. Řešení bude stejné.\nSeznam smluv v příloze.\nDíky PB'),
