(660,3,'FIRDOVKA','Ahojte.\n\nKatarine sa vzdy rano ked pride nedari prihlasit do systemu, ked sa restartne heslo nepovoli zmenu hesla. SAS - potrebuje s nim denne robit nakolko cez SAS mam pristupnu databazu nefunguje nakolko je autorizacia prihlasenim menom a heslo. \nDnes po restarte opatovne nejde prihlasit.\n\nProsim o riesenie. Skuste napr vyhodit ju zo skupiny pre SAS a opat nahodit. restartnu ucet a potom nahodit. \n\ns pozdravom\n\nSG '),
(661,1,'Cofisun','Ahoj, \n\nz 30.4. na 1.5.2019 sa mali ukončiť zmluvy do pozície \"i\" a dňa 1.5.2019 nám mal prísť mail. Zase nám neprišiel Mail s reportom, prosím o prešetrenie. Predtým ticket 625.\n\nĎakujem.\n\nS pozdravom\n\nZuzana Hlavenková'),
(662,1,'Cofisun','Dobrý deň prajem, \n\nprosím pekne, opäť máme problém, klienti boli na vymáhaní v externej agentúre, neúspech, takže sme zrušili TOP a chceli sme ich dať v rámci ventilácie do skladu, avšak nie sú v zozname zmlúv vo ventilácii. \n\nProsím pekne o ich doplnenie týchto zmlúv do ventilácie - zoznam zmlúv.\n\n\nSú to čísla zmlúv: \n23366, 25580, 24689, 23922.\n\nProblém je , že keď zrušíme akýkoľvek top, tak nám automaticky títo klienti vypadávajú zo zoznamu zmlúv vo ventilácii. \n\nďakujeme veľmi pekne. \n\nBibi a Marci\n'),
