(670,1,'Cofisun','Hello,\n\nwe would like to ask about postponement for product Cars. It is  very hard (impossible) to find contracts where is possible to do it.\nFor example for contracts 19585,20474,20869 are conditions fulfiled, but we do not have there button for postponement.\n\nActual conditions:\n- Contract in P1 or P2 (for current position)\n- The 6 last position is “1” (older than 6 month)\n- Payment method is direct debit\n- The customer can not make more than 2 postponement on during the loan.\n\n\nCould you tell us if there is other condition  ?\n\nBr.'),
(671,1,'Cofisun','Dear all,\n\ni am writing you on behalf of BEN.\n\nThere is following issue:\n\nWe have these following accounts: 71099865 and 71099935 , which have been opened in April but the période de traitement happens in May. The flux occurred before 16:20 and the bank transfers also occurred on the 30th of April, but into EISEC, the effective date is on the 01/05/2019. You’ll find below the screenshot of the bank transfers and the EISEC historique des mouvements.\n\nFor the detail, pls. find more data in the attachment.\n\nKind regards,\n\nM.'),
