(682,1,'Cofisun','After closing 13.05.2019 is again problem with ventilationon car contracts.\n\nFor first we lost contracts from advisory of external agency (MABORO or OVER LEASE) and those contracts on which we lost advisor MABORO or OVER LEASE aren´t in the basket of contracts in ventilation so its impossible to put them under external agency.\n\nWe asked to put under MABORO till 05/2020 these contracts:\n17263\n18018\n18816\n19118\n20398\n22618\n22867\n23366\n24535\n24667\n24759\n24878\n25580\n25616\n60009158\n\nWe asked to put under OVER LEASE till 05/2020 these contracts:\n\n15974\n16103\n17052\n19000\n19002\n19184\n19573\n20775\n21349\n21712\n21902\n22910\n24263\n25555\n25683\n\nAlso we aksed to put these contracts to SKLAD till 05/2020:\n18496\n22734\n22364\n17963\n18592\n20122\n23922\n25648\n24689\n20973\n25340\n\n\nThank you very much.\n\n\n\n\n\n'),
(683,4,'undefined','Máme tu prípad, kedy starobného dôchodcu systém automaticky odmietol na budgete, pričom podľa kalkulačky aj eisecu je budget OK, klient nemá nič v CRIFe a SSDB potvrdila poberanie star.dôchodku 304,- Eur bez zrážok – výsledok dopytu OK, prosím o preverenie a riešenie. Print screeny v prílohe.'),
