(689,4,'undefined','Pri elektronickej zmluve 90425925 (Adam Franta) sa nám nedá podpísať zmluva za Cofidis (pri zmluve by mala byť ikona červenej ceruzky kým nie je podpísaná aj z našej strany), po kliknutí sa stiahne hneď zmluva v pdf bez nášho podpisu. Prosím o riešenie.'),
