(691,1,'Cofisun','Hello,\n\nwe have question about contract 22188 in collection. In March and April it was in position P1, but in May it is  in P3.\nIs it because of service fee which was generated in February ?\nI am sure it is  not correct to skip position from P1 to P3. Am I right ?\n\nBr'),
(692,1,'Cofisun','Štatistiky fungujú len pri niektorých partneroch.\n\nProblém je pri Partneroch ako sú Brokeria, AAA AUTO.\nOtvorím Brokeriu, nemám možnosť vybrať Partnera, nakoľko je pevne daný len jeden, ale predajcov je tam 20. Zvolím si teda jedného predajcu, ale nič sa nedeje. \npri AAA je rovnaký problém\n\nale napríklad PAVAN - má 4 Partnerov, pri jednom partnerovi sú 2 predajci. - v tomto prípade štatistiky fungujú.\n\nďalší príklad CCofidis, má 2 Partnerov, 2 Predajcov - ak zvolím Pobočku Internal - štatistiky nefungujú, ak nechám Pobočku VYBRAŤ - štatistiky fungujú.\n\nv prípade nejasností prídem ukázať\n\n'),
