(697,1,'Ine','Ahojte\n\nv aplikácii CC Supervision, ktorá slúži a sledovanie aktivít call centra nie je funkčné vytváranie preddefinovaných xls reportov o minulej aktivite. (štatistika celej linky, časti linky, jednotlivých operátorov...)\n\nProsím pozriete sa na to?\n\nďakujem\n\nbr\n'),
