(700,4,'undefined','Prosím o preverenie problému s esignom pri zmluve 90426706 - klient má schválenú žiadosť, ale v Cofisigne ju nikde nenachádzame. \n\nPredtým mal klient schválenú inú zmluvu, ktorá sa stornovala cez klientsku zónu a následne sa mu schválila nová žiadosť.\n\nV Extranete vôbec nemáme ani možnosť opätovne odoslať prihlasovacie údaje.\n\nPripájam print screeny.\n\nĎakujem.'),
(701,3,'Pavel Jonas','Ahojte\n\nprosim preverite, ze Pavel sa moze dostat vsade na publicu?\nAktualne reklamuje, ze sa nevie dostat na ACCEPTATION\n\n\nDakujem\n\nMaja'),
(702,1,'Cofisun','Again problem with ventilation, after deleting TOP (External management) these contracts: 25616, 18816, 24667, are not in ventilation, so we can not give these contracts to SKLAD. \n\nWe please for repairing. \n\n\nThank you.'),
(703,4,'undefined','Ahoj,\nprosím o pridanie práv na nástroj \"Gestion des individus particuliers\" pre:\n\nS. Groma;\nM. Talandovú;\nZ. Hlivárovú.\n\nĎakujem,\n\nB.'),
(704,1,'Cofisun','Ahoj,\n\nna zmluve 50054883 máme nezrovnalosť medzi tlačenou zmluvou a parametrami v Eisceu (posialam v prílohe)\n\nPotrebujem upraviť parametre ako sú na vytlačenej zmluve tj. doba splácania 84 m, výška splátky 112.99 EUR.\n\nTiež by som potreboval zistiť či ide chybu systému alebo to niekto pri príjmani zmluvy zmenil.\n\nďakujem\n\nZdeno'),
(705,1,'Ine','Ahojte, \n\npri nahrávaní platieb zloženkami zo súborov, ktoré nám posiela Slovenská pošta, sa pri platbách, ktoré sú vyššie ako 100 € nahráva nesprávna suma. Desatinná čiarka sa posúva o jedno číslo doľava. \nPríklad - zmluva 50003668 - platba zo 16.5.2019 na účet 2007008978/1100 v sume 154,40 € , do EISEC sa nahrala suma v nesprávnej výške 15,44 €.\n\nNeplatí to však pri všetkých zmluvách.\nPríklad - zmluva 25768 - platba zo 16.5.2019 na účet 2007008978/1100 v sume 138,71 €, do EISEC sa nahrala správna suma 138,71 €.\n\nProsím o preverenie, prečo pri niektorých zmluvách nahráva do EISEC sumu v nesprávnej výške.\n\nDo ďalšej komunikácie pridajte, prosím, aj Pavlinu.\n\nVopred vďaka.\n\nTonka'),
