(724,1,'Ine','Ahojte, \n\nposielam poziadavku na novy report pre revolvingove zmluvy, aby mali zadany top vypoved zmluvy a zaroven neboli v pozicii \"i\". \n\nĎakujem \n\nJozef'),
(725,1,'Cofisun','Cieľ:\nChceme zistiť či vymazávanie uživatela a vymazanie zálohy uživatela má aký dopad na vymazanie profilov , funkcii a iných uživateľov u ktorých je daný vymazaný uživateľ ako referencia. Teda ak vymažem sám seba z EISECU, tak či zmiznú práva a funkcie ľuďom, ktorým som ako ja Referencia. \n\n1.) zistiť ako sú urobené hierarchie profilov \n      -  ktoré sú nadriadené nad ktorými. napr. finančný poradca klienti je nadriadený nad finančný poradca základný ? \n      -  či jeden profil je referenciou na ďaľší a ak sa jeden (vrchný) vymaže či padne vetva.\n\n2.) hierarchia funkcii \n     -  Chceme zistiť či funkcie (generálny riaditeľ , IT architekt)  pridávajú nejaké ďalšie práva uživateľom ,alebo to len súvisia z hierarchiou zamestnancov. \n\nDôvod:\nV minulosti sa stalo, že Dušan vymazal neaktívnych ľudí a aktívny ľudia sa nevedeli prihlásiť (zmizli im práva).\n\nRiešenie:\nNajprv by som začal Sara tiketom nech sa FR k tomuto vyjadrí, či majú nejaký dokument ako súvisia dané profily a funkcie medzi sebou. Ak nevedia, tak treba improvizovať. \n\n'),
