(739,1,'Cofisun','Ahoj,\n\nTestovali sme vo Forme poistenie na CD, výsledok v texte nižšie a v prílohách. \n\nZmluva nám nejde doschváliť a tak nám nejde financovať.\nNegeneruje automaticky zmluvnú dokumentáciu a na tlačenej zmluve nie je vidieť poistenie.\n\nV prílohe posielam zistené informácie z testov:\n-	Poistenie sa nedoťahuje na zmluvy\n-	V systéme poistenie je\n-	Negenerujú sa zmluvy\n-	Treba si ich dať manuálne vytlačiť\n-	Pri každom druhu poistenia sú rovnaké chyby\n\nPopisy printscreenov sú v súbore SENIOR\n\n\nZdeno\n'),
(740,4,'undefined','Ahoj Stano\n\nprosim Ta potrebujem pripravit novy zoznam zamestnavatelov- ICO a nazov zamestnavatela. Naposledy mi to robil David. Eisec tam nasiel nejake chyby.\n\n\n\"We have identified duplicate employers in the dictionary table (ex : 50438930, 50613502, 50616765).\n\nCould you send us a new employer dictionary file?\"\n\n\npoterbujem to co najskor\n\nDakujem\n\nMaja\n'),
(741,4,'undefined','We detected problem with adding/deleting/changing guarantor in Car Financing demands.\n\n\nTo modify the demand we click the button „Aide a la decision“. (see printscreen1)\n\nIt was possible to add/delete guarantor by using buttons bellow – these buttons are currently not working. (see printscreen2)\n\nWe tried to follow steps described in the user manual for guarantor management (pages 10-12;  you can find the manual in attachment). (see printscreen3)\n\nAccording to the user manual, there should be two buttons to add/delete the guarantor. (see printscreen4)\n\nThe buttons displayed in the user manual are missing in production screen. (see printscreen5)\n\n\nPrintscreens are only for illustration, the demand in which we had the problem to change guarantor was 260307. We solved the case by cancelling the demand 260307 and the partner created the new one with different guarantor (new demand 260329 was pre-accepted and currently we are waiting for the contract).\n\nCan you, please, check the process for adding/changing/deleting guarantor in demands?\n\nThank you.\n'),
