(743,4,'undefined','We discovered a problem with guarantor´s address on the contractual documentation, described below + print screens attached.\n\nFirst of all, the name of the street does not display in address tab in EISEC (see printscreen1), but when we open the address to modify it, the name of the street is there (see printscreen2).\n\nThe main problem with the guarantor´s address is that numbers of the street in EISEC are not correctly transferred on GPDR document (see printscreen3) and Vyhlasenie rucitela (guarantor´s declaration) (see printscreen4)– the number from the second field is missing on these documents.\n\nNumbers of the street are in two separate fields in guarantor´s reference in EISEC, which is okay, but we need to fix how it is displayed on GDPR document and Vyhlasenie rucitela ((guarantor´s declaration).\n\nThank you.\n'),
