(768,1,'Cofisun','Ahoj,\nprosím o preverenie, prečo prebehlo automatické zblíženie pri zložke: 01.426.421.101\n\nPopis a otázky sú na konci dokumentu, ktorý prikladám. Zároveň upozorňujem na posledný bod, ktorý som uviedla - je potrebné, aby nám tieto veci padali do manuálu a aby neprebiehalo automatické zlúčenie. Prosím aj na to dohliadnuť.\n\nPriorita je zistiť, či nám OZ nenahodila žiadosť s rovnakým R. Č. (toto my nevieme z autového Extranetu vytiahnuť).\n\nV prípade otázok som k dispozícii.\n\nĎakujem.\n\nB.\n\nP. S.: Neviem, či nepoužívate medzi sebou na \"Zlúčenie\" nejaký iný interný pojem ako \"Unification\" - ak áno, tak to, prosím, opravte.'),
