(777,1,'Cofisun','We had clients - contract number: 25555, 20775, 17052 under advisory of extermal agency. External agency didnt recovered claim and ended these contracts in their advisory  as unsuccessful so we deleted top external management and we wanted to put this contracts to SKLAD. \n\nBut these concrats arent in ventilation so we cant put them to SKLAD.\n\nPlease correct ventilation. \n\nAnd chceck this problem, because it is not the first that we have these problem.\n\n\nThnak you very much, \n\nBibiana'),
(778,4,'undefined','Prosíme o zrušenie zasielania výpisov na zmluvách, ktoré sú v pozícii P, b, H, C, V, 9.\nAko príklad uvádzam zmluvu 70237176 v pozícii b, kde nám klientka zatelefonovala, že dostala výpis na sumu 103€. Predpokladám, že nakoľko na finančnom oddelení urobili 20.3.2019 prevod preplatku vo výške 103€, že tento pohyb mohol byť podnetom na zaslanie výpisu. Prosíme však o úplné pozastavenie zasielania výpisov na uvedených pozíciach. Prosíme o preverenie. '),
(779,4,'undefined','Potrebujeme povoliť prístup do slovenského testovacieho prostredia EISEC pre nasledujúcich užívateľov, ktorí pracujú na projekte Business Rules Management System (BRMS for EISEC) :\n\nJulien Huart (Cofidis Participations - Synergie)\nGérald Hallot (Cofidis Participations - Synergie)\n\nĎakujem.\n'),
