(781,1,'Cofisun','Dobrý deň prajem, \n\nuž sme to riešili v minulosti, ale ostalo to nedoriuešené, do môjho \"To do\" listu padajú veci, ktoré sú na kontaktné centrum.\n\nPrikladám to do list - printscreen.\n\nĎakujem veľmi pekne. \n\nBibiána'),
(782,1,'Cofisun','Ahoj, \n\nposielam printscreen z Eisecu, pri generovani vstupneho listu na cofidirect, zadal som premenu aby hodilo datum prvej mesacnej splatky do listu a vyhodilo to chybu. Otocite to na francuzov prosim aby nam zaslali vysvetlenie. \n\nprintscreen je v prilohe\n\nDik \n\nJozef '),
(783,1,'Cofisun','Ahojte, \n\nprosím o dodanie vysvetlenia z FR k premennym z EISEC, \n\n#mesicni_sml_splatka# ku tejto premennej dotiahlo nespravnu vysku splatky\n\nku ostatnym vyhodilo chybovu hlasku\n#mesicni_splatka#\n#vyska_mesicni_splatky#\n#vyska mesacnej splatky#\n\nPrintscreeny su v prilohe\n\nDik \n\nJozef '),
(784,1,'MicrosoftOffice','Prosíme o vyriešenie problému s kapacitou schránky.'),
(785,4,'undefined','prosím o preverenie a riešenie:\n\nZmluva 90435722 bola elektronicky podpísaná klientom a tiež na našej strane, na základe čoho sa odoslala informácia predajcovi na expedovanie tovaru.\n\nAktuálne pri kontrole pred financovaním sme zistili, že na Zmluve o úvere podpis klienta chýba (je tam ale informáci o to, že to bolo podpíané cez Cofisign + dátum a čas, ale podpis tam nie je) - print screen v prílohe.\n\nOstatné dokumenty (Informácia o spracúvaní osobných údajov a Finančné sprostredkovanie sú podpísané v poriadku a podpis klienta na nich je).'),
(786,2,'BIP','treba vybaviť novú kartu pre zuzku, má starú ktorá nemá podporu pre tlačiareň napr.\r\n\r\nSA0000038845451'),
(787,1,'Cofisun','Hello, \n\nwe had these clients- contract number: 24878 and 18494 in external agency and we had TOP external management. the process of recovery our receivables was unsuccessfull and we want to put these clients to sklad. \n\nWe deleted TOP EXTERNAL MANAGEMEMNT and want to give these contracts to SKLAD (advisor) fot a certain time, but its impossible becasue contracts are not in ventilation. \n\nWe again ask about help and repairing that every contracts on which we deleted TOP external management will be in ventilation and we will have option to put them to SKLAD. \n\nThank you very much. \n\nBibiána'),
(788,3,'Lucia Oravcova','Ahoj Juraj\n\nprosim vytvorit Lucke pristupy do ticketovacieho toolu.\n\nDakujem\n\nMaja'),
(789,4,'undefined','Ahoj,\nprosím o zistenie, akým spôsobom bol klient 00.992.739.101 informovaný o zamietnutí žiadosti zo 7.10.2017 - či emailom alebo SMS. Zároveň prosím o informáciu, na akú adresu / tel. č. mu bola informácia zaslaná.\nĎakujem.\nB.'),
(790,4,'undefined','Dá sa prosím zistiť, či sa k žiadosti vytvorí automaticky klientska zóna s možnosťou vloženia dokladov, aj keď je žiadosť v Extranete stále v posúdení (teda nebola ešte schválená)?\n\nRiešime tu jednu komplikovanú situáciu, kde neviem či nastala chyba v Cofisigne alebo zlyhal ľudský faktor.\n\nMáme dvoch klientov – Ján Grolmus (v extranete stále v posúdení) a Branislav Grolmus (ten mal schválenú žiadosť a bola dodatočne zamietnutá, pretože do klientskej zóny nahral OP ktorý bol viditeľne poškodený).\n\nKonkrétne ide o situáciu, kedy analytik kontroloval doklady v Cofisigne, pričom zistil, že pri žiadosti na Jána Grolmusa boli vložené doklady na Branislava Grolmusa. Ale žiadosť Jána Grolmusa nebola doteraz schválená, stále čaká na posúdenie.\n\nV archíve Cofisignu nachádzam iba Branislava Grolmusa.\n\nPotrebovala by som zistiť, či Ján Grolmus aj Branislav Grolmus majú vytvorenú klientsku zónu a kedy sa klientovi generujú prístupy do klientskej zóny. \n\nVopred veľmi pekne ďakujem.\n\n'),
(791,1,'Helios','Prosim nainstalovat Helios a vytvorit uzivatela, uzivatelske prava ako Pavlina Borovkova\r\n'),
(792,4,'undefined','Ahojte.\n\nProsim zadat SARU.\n\nChange xue_16 to Competence Cofidis for all products in SK.\n\n'),
(793,3,'Ben','Ahoj Juraj\n\nprosim Ben nema nastavenu tlaciaren.\nProsim vies sa u neho zastavit a vyriesit to?\nDakujem\n\nMaja'),
(794,2,'BIP','z nejakého dôvodu fr neobjednalo bip pre Martina Koubeka, vytvorený ticket pretože cez normálnu objednávku nejde vyplniť formulár SA0000038881560'),
(795,4,'undefined','Ahoj Juraj,\n\nstahuje sa nam automaticky xml vypis spolu s ostatnymi bankovymi vypismi (vid nizsie). To ale nechceme. Mohol by si prosim doriesit aby sa ten vypis nestiahol?\n\nPotrebovali by sme to asap.\n\nDakujem!\n\n\n'),
(796,4,'undefined','Ahoj prosim zadat na RUBIS ak este nie je.\n\nMyslel som, ze som posielal mailom na zaciatku Juna, no neviem najst v odoslanej poste. \n\nJe to RUBIS na upravu cerpania bezucelovej rezery aby bol proces automatizovany pre CC. \n'),
(797,3,'Marcela Jurickova','Ahoj Juraj\n\nprosim pridas Marcelke pristupy do-citanie a zapis do:\n\nFOTO\nGED\nOA_NOTARY\nOA_POST\nCAR CONTRACTS\nPROBRI\nPRODUCTS\nPROJECTS\nPUBLIC\nSKOLENIA\nTESTY CARS\nTESTY COFIKLASIC\nVNUTORNE PREDPISY\nVP_ALL\nVP_CLIENT\nOPERATIONS\n\n\nDakujem\n\nMaja'),
