(800,1,'Cofisun','Hello, \n\nI am again writting about my TO DO LIST. When I open my TO DO LIST there are some emails which belongs to KONTAKTNÉ CENTRUM (customer service) or to  ACCEPTATION. \n\nAnd also is problem that although is there under one reference a lot of emails - these emails also belongs to another contract. These emails are mostly sent from lawyers company which are our contractś partners. \n\nEverytime these companies send judgements and other documents to our email: informacie@cofidis,sk for saving them.\n\n\nPlease it´s  very important to solve this problem. \n\nAlso in my to DO LIST are some tasks whoch belongs to ACCEPTATION. \n\n\nThank you very much for solving this problem.\n\nBibiána \n'),
(801,1,'Cofisun','Prosim zistit, preco system posiela email, aj sms automaticky aj pri zasielani zmluvy postou. Podla manualu by pri volbe pdf nemal ist email, ale dnes po vytlaceni zmluvy ju system odoslal aj mailom a poslal aj sms.\nDakujem!'),
