(805,4,'undefined','Ahojte,\nkontrolou som zistila, že nám do dnešného dňa neposlali faktúru z EI za mesačné poplatky v mesiaci máj 2019, ako aj faktúru z EURO P3C za BIP karty.\nMohli by ste, prosím, faktúru vyžiadať a zároveň ich požiadať, aby nám ju posielali včas? \nNeskoré doručenie faktúr zo zahraničia nám spôsobuje, že musíme podať dodatočné daňové priznanie, ktoré je penalizované.\nVopred veľká vďaka.\nTonka'),
(806,4,'undefined','V nasledzjúcich prípadoch nám EISEC vygeneroval vyššiu splátku ako na zmluve, prosím o opravu splátok podľa zmluvy:\n\n90443601 - contract 39,82 / eisec 39,83\n90441297 - contract 94,30 / eisec 94,44\n90434107 - contract 19,64 / eisec 19,67\n90434914 - contract 22,46 / eisec 22,49\n90437552 - contract 23,45 / eisec 23,49\n90440823 - contract 78,06 / eisec 78,21\n90438858 - contract 32,23 / eisec 32,26\n90440902 - contract 13,28 / eisec 13,31\n90440985 - contract 80,79 / eisec 80,86\n90442867 - contract 25,56 / eisec 25,58\n90435402 - contract 36,61 / eisec 36,68\n90437631 - contract 88,81 / eisec 88,96\n90438236 - contract 20,78 / eisec 20,82\n90436692 - contract 12,34 / eisec 12,36\n90441534 - contract 36,68 / eisec 36,75\n90441525 - contract 31,43 / eisec 31,50\n90441687 - contract 40,83 / eisec 40,92\n90438459 - contract 27,31 / eisec 27,37\n\nĎakujem.\nZuzana\n'),
(807,3,'Sdílené složky','Dobrý den,\n\nprosím o odebrání níže uvedených uživatelů z folderů Preventive Risk, Acceptace, Accounting, Controlling:\n- Lucia Oravcová\n- Marcela Jurčíková\n- Petra Mirvaldová\n- Mária Mastiláková\n- LD F61 Cof SK Klientský servis\n- LD F61 Cof SK Veduci oddelenia\n- LD F61 Cof SK IT\n\nProsím stejně tak o odebrání těchto osob a skupin z uživatelů, kteří mají přístup do těchto složek. \nAni jeden z těchto uživatelů nebyl schválený majitelem sdílených složek (ředitelem).\nDěkuji PB'),
(808,4,'undefined','Klientke bol rano poslany automaticky email na Cofiklasik uver, teraz volala, ze prilohu nevie otvorit, dali sme prepolat mail, prikladam screen shots.\nDakujem!'),
(809,1,'Cofisun','nove znenie textu:\n\nVážený klient,\n\nS radosťou Vám oznamujeme, že Vaša žiadosť č. #cislo_smlouvy# o úver od spoločnosti Cofidis bola SCHVÁLENÁ. \n\nKliknutím na prílohu tohto emailu si budete môcť vytlačiť zmluvy. Zmluvy je potrebné vytlačiť jeden list na jednu stranu (nie obojstranne - obojstranne vytlačená zmluva nie je platná). Podpísané zmluvy je potrebné zaslať na adresu Cofidis (Einsteinova 11, 85101 Bratislava) v 1 vyhotovení, určenom pre Cofidis (označenie Banka na spodnej strane zmlúv) do 30 dní, v opačnom prípade bude Vaša žiadosť stornovaná.\n\nVšetky zmluvné podklady prosím podpíšte a priložte obojstrannú kópiu občianskeho preukazu a kópiu posledného výpisu z účtu.\n\nV prípade akýchkoľvek otázok môžete kontaktovať našich pracovníkov na zákazníckom oddelení, ktorí sú Vám k dispozícii na telefónnom čísle +421 232 222 000 každý pracovný deň od 8:00 do 18:00.\n\nĎakujeme a prajeme pekný deň\nS pozdravom,\nCofidis\n\nTel: +421 232 222 000\nMail: kontakt@cofidis.sk\n'),
(810,1,'Cofisun','Prosim vytvorit v Cofisun pristup do foldra oznaceneho v prilozenej prilohe. Dakujem!'),
(811,1,'Cofisun','Ahojte,\n\nchcela by som Vas poprosit o odstranenie uzivatelov z portfolio2 (vid obr.) Ako prva uroven som ja a druha uroven ma byt len Kantorek, Nemeth a Remsikova.\nCez tento tool mozem kontrolovat portfolio vymahania, ale aktualne to mozem len jednotlivo alebo musim dat funkciu Vsetci a to sa mi tam zaradi aj portfolio pravneho vymahania,\nTaktiez cez tento tool posielam hromadne upomienky, co tiez nemozem urobit hromadne, ale si kazdeho uzivatela filtrovat zvlast.\n\nVopred dakujem'),
(812,4,'undefined','Prosim o opravu splatok v EISEC v nasledujucich pripadoch:\n\n90428076 - contract 24,61 / eisec 24,64\n90442324 - contract 18,86 / eisec 18,89\n90442263 - contract 31,33 / eisec 31,37\n90441809 - contract 21,99 / eisec 22,02\n\ndakujem.'),
(813,1,'Cofisun','Hello,\n\non the contracts 25773,25470 and 25108 was today received payment of the monthly instalment and immediately storno the payment. The clients have paid the monthly istalment in June and now it seems like unpaid and we are waiting for payment, but it is  not correct.\nWe consulted this issue with financial department and they did not find the payments from today on these contracts.\nCould you check it what is  happened and if there is more contracts like that ?'),
(814,4,'undefined','Ahoj.\n\nProsim zrusit mailovu adresu posudenie@cofidis.sk\n\nDakujem '),
(815,4,'undefined','Katka Vyparinová má problém pri prihlasovaní do PC - vôbec sa jej nedá prihlásiť, po zadaní hesla sa objaví hláška \"you are not permitted to log on without a badge\".\n\nProsím o urgentné vyriešenie situácie.\n\nĎakujem.\nZuzana'),
(816,1,'Ine','Prosim o pristup do call centre supervision tool. Dakujem!'),
(817,4,'undefined','Prosim zadat SARA na zmenu minimalneho prijmu pri SSDB.\n\nHello.\n\nPlease, change minimaln income in 2nd call of SSDB consultation from 405 to 500. Parameter in XML batch request is AMOUNT and AMOUNT_AVERAGE.\n\nI think this value is \"hardcoded\" in the 2nd call request. It would be better to link to SSDB income tables, because we change the tables, but minimal income not change. Today minimal income is around 500€.\n\nThank you \n\nSG'),
(818,1,'Cofisun','Dobrý den,\nposílám EDB na změnu účtu financování z EISEC. Jedná se o účet,  ze kterého odchází financování partnerům a klientům.\nPo dlouhé době tak dokončujeme proces oddělení účtů financování a splátek.\nProsíme předem o informaci, kdy to bude nasazeno do produkce, abychom mohli nový účet nadotovat dostatečnými prostředky.\nDěkujeme!\nPB + MK'),
(819,1,'Cofisun','Ahoj,\n\nProsim preverit, preco mi nejde funkcia potvrdenia obchodnej splatky, chcela som zadat ocakavanu ciastku 0, ale nepustil ma system, Zuzka to nasledne skusala a jej to islo v pohode.\n\nDakujem!'),
(820,3,'Peter Deák','Cauko, \npls vytvorit užívateľa Peter Deák, náš nový IT muž.\nnástup 1.8.2019\nref user Nemčík Juraj\n\ndakujem\npapapa'),
(821,4,'undefined','Ahoj,\nKlientka uz druhy mesiac za sebou dostala vypis z uctu aj napriek tomu, ze zmluva je ukoncena. Viete sa v systeme pozriet na to, aby ukoncenym zmluvam uz nesli vypisy, prosim?\nDakujem!'),
