(824,1,'Cofisun','Ahoj,\nZistili sme, ze system automaticky vygeneroval a poslal email so zmluvou na podpis, s pokynmi na dodanie potrebnych dokumentov, pricom tieto klient uz dodal nam a su zaevidovane.\nDakujem!\nM.'),
(825,4,'undefined','Ahojte, potrebujem preveriť či má Ivana Ličková vytvorené prístupové údaje do Cofisignu, aktuálne sa tam nevie prihlásiť. \n\nAk nemá, tak prosím o vytvorenie. \n\nMomentálne sa vie dostať iba do archívu elektronických zmlúv.\n\nĎakujem.\n\nS pozdravom\nZuzana'),
(826,1,'Cofisun','Ahoj,\nVolala klientka, ze jej prisiel od nas prazdny sek, bez akehokolvek sprievodneho listu, v systeme o nom nie je ziaden zaznam. Prosim preverit.\nDakujem!\nM.'),
(827,1,'Cofisun','Ahoj,\nPoprosim pridat v cofisune pravo na vymazanie komentarov, Zuzka Hlavenkova to ma v nastaveniach, moje nastavenia a pravomoci by mali byt podla nej, podla mojich info.ň\nDakujem :)\nM.'),
