(830,1,'Cofisun','Hello, \n\nagain I am writting about my TO DO LIST. Although IO am advisor for clients in some positions 9, H, U etc. it cant happened that in my to do list I will have emails which are sent on email: informacie@cofidis.sk (or kontakt@cofidis.sk), becasue those emails must co- workers from customer care department save to cofisun.\n\nUnder one reference number of client there are several mails which belongs to another clients. \n\nThose tasks - emails are from 2018 but also from 2019.\n\nPlease to correct this mistake and solve this problem ... that those emails will be sent to to do list of customer care department = KONTAKTNE CENTRUM.\n\nAlso I had in my to do list some QURIES about approving which belongs to the department of acceptation. \n\nThank you very much for your time and help. \n\nBibiana'),
