(837,1,'Ine','Ahojte,\n\nkazdy 1/2 posielame do nbs xml subor, ktory ked otvorim ja na mojom NTB, vidim ho ako excel.subor. Ked tento isty subor otvori Alenka Donatova, dostane zhluk udajov, ktory je pre nas \"obycajnych\" uzivatelov uplne necitalny. Porovnanie prikladam vo worde, posielam aj xml. predpokladam, ze je to nejakym nastavnim NTB. Mohli by ste sa na to prosim u Alenky pozriet. Je momentalne na HO, dohodnite sa prosim, kedy bude fyzicky v praci.\n\nVelmi pekne dakujem!\n\nm'),
