(851,1,'Cofisun','Ahojte,\n\npri otvorení zmluvy 90391367 som si všimla zlé zobrazovanie úrokov a minimálnej splátky v Cofisune a tiež vysoké úročenie ku koncu prebiehajúceho mesiaca. Prosím o opravu, lebo informáciu o zostatku ku koncu mesiaca, hovoríme aj klientom, ak sa ozvú, že chcú predčasne splatiť po 15. dni v mesiaci. Počítač som reštartovala a stále to ukazuje chybné údaje na všetkých revolvingoch. Ostatným operátorom sa to zobrazuje správne, chyba je len u mňa. Posielam printscreeny.'),
