(881,1,'Ine','Ahojte,\n\nna zaklade dohody s Majuskou, by som vas chcela poprosit o instalaciu nasledovnych aplikacii pre Luciu Povodovu, ktora nastupi 2.9.2019.\n\nPoziadkavku na novy ntb by mala poslat Kika, uz som sa jej na to pytala.\n\nHelios - rozsah prav tak ako mama ja\nHFM - aplikacia na konsolidaciu a controllingovy reporting (ako to istalovat Vam ukaze Ben) - treba doistalovat aj Alenke Donathovej\nNBS SZP - prosim aj vsetky potrebne certifikaty (NBS figurujem ako nejaka zodpovedna osoba. Prehodte to prosim asap na Alenku Donathovu prosim.)\nVPN - aby Lucka mohla robit z domu v pripade potreby\nShared discs - accounting, controlling\n\nChcela som Vas poprosit, ked Lucka 2/9 nastupi, aby jej vsetko fungovalo, otestujte to prosim.\n\nJa tu budem fyzicky az 3/9.\n\nDakujem krasne!\n\nm\n\n\n\n '),
