(884,1,'Cofisun','Ahoj,\n\nTito nasi klienti stornovali zmluvy a chceli sme ich dat do pozicie D, ale nejde to ani mne, ani Zuzke, vypisuje hlasku vid priloha. Su to zmluvy 50083227 a 50076848.\n\nDakujem,\nM.'),
(885,1,'Cofisun','Ahoj,\n\nProsim, potrebovali by sme zistit viac info ohladom podmienenej nuly, nakolko sa nam tu deju dva zvlastne scenare, ak klient zaplati skor, ako ma podmienku PN:\n1. Klient zavola, ze chce splatit skor, dostane pokyny, ze tym padom musi zaplatit aj uroky, ktore zaplati podla pokynov, avsak system mu uzna PN a uroky navyse zuctuje ako preplatok, ktory my nasledne musime zuctovat v prospech Cofidis\n2. Klient nezavola, len sam zaplati celu sumu, bez urokov, skor, nez by mal, system mu uzna aj tak PN a da ho na 0. \n\nVieme sa niekde opytat, ci je to takto nastavene schvalne? Lebo my mame of financneho info, ze PN moze zbehnut iba v pripade, ak klient zaplati v mesiaci, kedy ma nastavene podmienky pre PN. \n\nAktualne nam takto zbehla PN u skorsieho splatenia dvakrat, posielam cisla klientov: 90404867, 90273812.\n\nDakujem,\nM.\n'),
(888,2,'Ine','Ahojte Chalani\n\n\npotrebujeme rozbehat wify v zelenej zasadacke.\nPotrebujeme tam podla mna novy rooter- to si ho objedname na prenajom od Telecomu, alebo normalne kupime zariadenie v alze nechavam na Vasom vyhodnoteni\n\nbolo by super ak by sme do zmakli do konca augusta\n\nDakujme\n\nMaja'),
