(895,1,'Cofisun','Ahoj,\nprosím o aktualizáciu zodpovedných zamestnancov v EISECu podľa reality.\nTýždenne mi chodí report na zakázané slová, kde nie sú aktuálne údaje ohľadne vedúcich zamestnancov. Tieto údaje musím preto manuálne prepisovať.\nV prílohe posielam príklad takéhoto reportu.\nPredpokladám, že je potrebné urobiť kompletnú revíziu, nie len v týchto 3 prípadoch.\nĎakujem.\nB.'),
(896,1,'Ine','Ahojte,\n\nna odd. vymahania a klientskeho servisu mame problem s prepojenim klienta na groupove cislo oddelenia, tzn., ze ak ak klient v omeskani vola na klientske centrum nie je ho mozne prepojit na cislo vymahania 7222033 (0232222033), ozve sa hlaska v taliancine a hovor padne. Agenti teda len skusaju prepajat priamo na klapky, tym drzime klienta zbytocne na linke dlhsie a vela krat prepojenie ani nie je uspesne. (z dovodu nepritomnosti agenta a pod) Problem je aj opacny, z vymahania na klientsky servis 7222000'),
(897,1,'Cofisun','Hello, \n\nclient, contract number: 50035536 was unsuccessful at external agency and till the time we send him a declaration we need to send him for a certain time to SKLAD. We cancelled top external management but client is not in list of contracts in ventilation gestion and it is impossible to give this contract to SKLAD.\n\nThak you for help. '),
(898,3,'MIKOVOPA','Ahoj. Pavline isiel pristup do ESIEC pouzivali sme ho predvcerom (pondelok) \n\nDnes jej dava chybu. Screen v prilohe. Prosim vyriesit. Nakolko bez EISEC a SAS sa nepohneme (SAS - je v rieseni) '),
(899,1,'Cofisun','Ahoj,\n\n60003341, klient uhradil splatky navyse a automaticky sa mu spravilo ciastocne predcasne. Podla pravidiel, pokial nam klient neda informaciu co zamysla s platbou, tak to nechame na dalsie splatky. \nPotrebovali by sme, aby to vo Fr oductovali, vratili vysku splatky na povodnu sumu 124,24 eur a nasledne prijatu platbu 269 eur zauctovali ako dve splatky.\n\nDakujem,\nM.\n'),
(900,1,'Cofisun','Ahoj,\n\nVcera sme so Zuzkou zistili, ze mne sa v to do liste nezobrazuju vsetky polozky, ktore vidi Zuzka, posielam prilohy, ten word je Zuzkin To do list, foto je moj. Mozem dostat pristup ku vsetkym, prosim? Este tam chybaju ciastocne predcasne splatenia, nakolko taka polozka tam aktualne nebola.\n\nDakujem,\nM.'),
(901,1,'Cofisun','Hello,\n\nI have only question about external managment. When is contract finished in external managment for example 14th of August (like for contract 22645) and previous weekly closing was 12th of August and next will be 11th of September. Will be contract still in group \"External\" till next weekly closing? it can not be changed to All P1 Auto ? Am I right ?\nI need to confirm this information, because after finishinf at External managment there is no advisor and I have to set up some process for these cases\nThanks\n\nBr\n\nJana'),
(902,1,'Cofisun','Ahoj,\n\nv utorok 20.8.2019 sme dali na financovanie autovú zmluvu PO (60045569), načítalo nám info riadok ale nenačítalo celkovú dlžnú čiastku a ani peniaze partnerovi neodišli.\n\nV prílohe zasielam printscreeny.\n\nPozrite sa mi prosím na to a dajte vedieť čo s tým.\n\nĎakujem\n\nZdeno'),
(903,1,'Cofisun','Počas pripájania zlyhá vzdialené pripájanie Frederiky Knapíkovej na EISEC bez akéhokoľvek erroru, alebo akcie.'),
(904,4,'undefined','prosím o riešenie problému - Katka Vyparinová nemá možnosť manuálne vygenerovať úvodný list 14.11. pre PO (vid. screen v prílohe). Niekedy totiž automaticky vygenerovaný list skončí s chybou a je potrebné ho manuálne vygenerovať - asi to bude len v právach, pretože mne to išlo, aj ostatným analytikom.\n\nProsím o doriešenie.\nĎakujem.'),
(905,1,'Cofisun','good morning, \n\nafter closure happened that advisor on contract \n\n90303702\n90330939\n\nis Branislav Held. \n\nI changed advisor manually but I am asking to change what happened. Because there are rules that for position 9 is advisor my person. \n\nAnd I changed the position  06.08.2019 on both contracts. \n\nThank you very much.\n\nBibiana'),
(906,1,'Cofisun','Hello,\n\nI would like to ask you to change translation in screen Synthesis/ part Contracts (Zmluvy) - NOTE\n\nactual incorrect translation - Poznámka\ncorrect translation - Známka\n\nThanks\n\nJ.'),
(907,1,'Cofisun','Ahoj,\n\nPotrebovali by sme, aby sa vo Fr pozreli na to, preco nam system nezuctovava poplatky v co najskorsom moznom termine. My klientom hovorime, ze preplatky aj ukonceniu zmluvy maju do 30 dni, ale system nam potom v auguste hodi, ze poplatok sa zuctuje k 15.10., cize aj preplatok vieme vratit az po tomto datume. ä\nDalo by sa to urobit tak, aby zadane poplatky boli zuctovane co najskor, prosim?\n\nDakujem,\nM.'),
(908,1,'Ine','Ahojte,\n\nprosím o pomoc, máme žiadosť z eshopu na schválenie, ale schváliť v extranete nejde. stále je stav žiadosti posúdenie. Ide o žiadosť číslo 90456491. Žiadna chybová hláška, len to neurobí stav Schválená. \n'),
(909,1,'Ine','Ahojte,\n\npri e-podpisoch nam nepodpise ziadost, mame tam len jednu na spracovanie. Klikneme na podpis, aj podpiseme, ale potom sa uz nic neudeje, podpis sa do zmluvy nenacita. Ziadost 90456516'),
(910,1,'Cofisun','Hello, \n\ntoday when I opened my to do list I saw that I have there again a lot of tasks: spracvoanie ziadosti o financovanie, which doent belongs to me. \n\nPlease chceck it and add to to do list of right person\n\n Thank you \n\n'),
(911,1,'Cofisun','Good morning, \n\ntoday after monthly closing we are sending letters \"declaration of maturity\" or \"termination of contract\" to our debtor and co-debtor.\n\nToday we wanted on contract, number: 90408392 to send in cofisun through option : Zasílaní - termination of contract to co-debtor, but we didnt have option to choose the person of co-debtor for this letter. \n\nFor this reason we are asking about promptly repairing of this situation. \n\nWe need to send this letter today. \n\nThank you very much for your help. \n\nBibiana  '),
(912,1,'Cofisun','Ahojky,\n\nPotrebovali by sme sa pozrieť na klientku číslo 19550 a jej splátky, respektíve finančný plán, je to veľmi čudné, lebo je tam časť splátky zrušená /aj pri budúcich splátkach/, keď som si vytlačila finančný plán, je tam iná výška splátky ako v systéme /o 2 Eur menej/. Na zmluve je  zadaný spôsob sťahovania platby inkasom, a preto nám tiež nie je jasné, prečo sú platby sťahované vždy v inej výške. Prosím o preverenie, či je finančný plán správny a ak nie je, tak o opravu. \n\nDakujem,\nM.'),
(913,1,'Cofisun','Ahojte,\n\npo odfinancovaní autovej zmluvy 50089308 kde je aktívne postenie, sa nám v EISEC nevygenerovala splátka aj spoistením ale je tam len bez postenia. Výška splátky bez postenia je v platobnom rozpise - viď príloha.\n\nKontroloval som aj inú zmluvu s poistením a v platobnom rozpise v EISEC je výška spolu s poistením.\n\nV prípade nejasnosti sa ma pýtajte.\n\nZdeno'),
(914,1,'Cofisun','Ahojte,\n\nnejde nám odfinancovať schválená žiadosť 90457351 (01.481.996.101). Vypisuje pri zadaní financovania, že nesprávne rodné číslo. Ale rodné číslo je správne. Prosím o preverenie. V prílohe posielam hlášku a aj kópiu op.\n\n '),
(915,1,'Cofisun','Ahoj Stanko, \n\nna základe tvojej emailovej požiadavky, zadávam požiadavku cez ticket. \n\nKlient UZ 14095 nas poziadal, aby sme mu zaslali potvrdenie o vyplateni dlhu plus chcel vymaz z cifu – samozrejme, ze vymaz nemoze vykonat 5 rokov tam bude mat zaznam. \n\nKazdopadne, ale klient uhradil pohladavku v zmysle dohody o urovnani a splatkach a to 10.10.2018, ale kedze tam bol nedoplatok, tak je potrebne, aby sme ho dali do straty. Do straty isiel az vo februari 2019, pricom jeho pohladavka bola splatena v 10/2018.\n\nprosim pozriet ako ma klient nastavene informacie v CRIF, \n\nDakujem velmi pekne. \n\nBibiana \n\n'),
(917,4,'undefined','Prosim dazad SARA na DA30\n\nHello.\n\nWe need to add to the CRIF actualization request ref_idt in  (515,603,602,601) with OpPhase \"DO\"\n\nThank you\n\nSG\n\n'),
(918,4,'undefined','cauko \npls o vytvorenie foldru LIKE PROJEKT kde budeme mat pristup a prava na vsetky aktivity: Kristina Sucova, Michaela Barabasova, Petra Mirvaldova a Daniela Kapitanova + Pavel Jonas\nvopred dakujem\npapa\nK.'),
(919,1,'Cofisun','Ahoj,\n\nZasa mam rovnaky problem, ako pred nedavnom, ze v To Do liste sa mi neukazuju polozky, teraz ich mam dokonca este menej, ako na zaciatku. Minule mi to opravili, mala som tam vsetko a teraz to zmizlo. Prikladam foto mojho a Zuzkinho listu.\n\nDakujem,\nM.'),
(920,2,'Tlaciaren','Tlačiareň robí pri skenovaní a kopírovaní cez ADF pás na dokumente.'),
(921,4,'undefined','Ahojte chalani, \r\n\r\nV Outlooku mi nejde rezervovať si zasadačku. \r\n\r\nKuk PrintScrn. \r\n\r\nMôžete mi to nastaviť? \r\n\r\nĎakujem. \r\n\r\nLucia\r\n'),
(922,4,'undefined','Prosím o opravu splátok v EISECu v nasledujúcich prípadoch:\n\n90456074 - contract 28,81 / eisec 28,84\n90455239 - contract 27,32 / eisec 27,35\n90456669 - contract 97,98 / eisec 98,08\n90455683 - contract 25,36 / eisec 25,39\n90454138 - contract 102,07 / eisec 102,20\n90454226 - contract 83,01 / eisec 83,03\n90454077 - contract 28,19 / eisec 28,23\n90454936 - contract 33,85 / eisec 33,90\n90455266 - contract 11,99 / eisec 12,01\n90457306 - contract 62,11 / eisec 62,15\n90454165 - contract 53,23 / eisec 53,30\n90450843 - contract 64,86 / eisec 64,94\n90456942 - contract 136,22 / eisec 136,35\n90455284 - contract 22,67 / eisec 22,70\n90454704 - contract 21,15 / eisec 21,18\n90452957 - contract 11,60 / eisec 11,62\n90457973 - contract 72,93 / eisec 72,98\n\nĎakujem.\nZuzana \n'),
(923,3,'Marek Fecko','Ahojte, \nprosim o zrusenie uzivatela Marek Fecko k dnesnemu dnu.Avsak je tam potrebne presmerovanie mailov o ktorych Vas infomoval Tomas Vasil.\nVieme sa na to pozriet?\n\nVopred Dakujem.\nK.'),
(924,3,'Martina Kormošová','Ahojte,\nprosím o vytvorenie užívateľa a prístupov pre novú kolegyňu Martina Kormošová, 18.9., Senior Účtovník, ref user: Antónia Zábojníková.\n\npre detailne info prosim kontaktujte Zuzku Agh.\n\nDakujem\nK.\n\n'),
(925,1,'Ine','Ahoj,\n\nPoprosim o pridelenie prav a pristupov Evke Paulikovej podla vzoru Jozkovych, nakolko v pripade nepritomnosti Jozka ho bude zastupovat prave Evka, ide o pristupy do WEBI a aj v EISECu.\n\nDakujem,\nM.'),
(926,1,'Cofisun','Good morning, \n\nwe gave client contract number: 15974  to external agency for recovery. But external agency was unsuccessful .. client was given back, we deleted top external management and til the we  declare maturity of contract we use to give client to SKLAD. We waited on closing as you wrote in previous recommendations (when we had the same problem) but we still cant give client to sklad. \n\nCan you please check the situation, what is the reason that this contract isn´t in ventilation. \n\nThank you. \n\nprevious tickets about the same problem: 897, 872, 787, SA0000039183626, SA0000038861194.\n\n'),
(927,1,'Cofisun','Good morning,\n\nwe gave client contract number:  24969 to external agency for recovery. But external agency was unsuccessful .. client was given back, we deleted top external management and after montly closing we put client to SKLAD but clients fell under advisory of coleeage from collecting : ROMAN NEMETH who changed the advisor od MARCELA TRNAVSKA, we need to give this contract to SKLAD but we cant do it. \n\nWe pleased about reparation.\n\nThank you very much.\n\n\nprevious tickets about the same problem: 926, 897, 872, 787, SA0000039183626, SA0000038861194.\n'),
(928,2,'Monitor','Ahojte,\n\nak by ste mali cestu do skladu, mohli by ste prosim dat druhy monitor Lucke?\n\nDakujem!\n\nm'),
(929,1,'Cofisun','Ahoj,\n\nV nasom oficialnom sadzobniku poplatkov mame poplatok za predcasne splatenie uveru 5%, ale minimalne 200 a maximalne 1500 eur, pricom system toto obmedzenie zrejme neeviduje, nakolko na danej zmluve pri kalkulacii vycislil poplatok 2984,51 eur, co je tych realnych 5%.\n\nPozriete sa na to, prosim?\n\nDakujem,\nM.'),
(930,1,'Helios','Ahojte,\n\nprosim nainstalovat Benovi HELIOS.\n\nDakujem.\n\nm'),
(931,4,'undefined','Prosím o preverenie situacie pri financovani. V EISECu sa zmluva tvari ako schvalena a uskutocnena, ale v synteze nemame dotiahnute udaje, vid print screeny v prilohe.\n\nStalo sa to pri zmluvach 90459483, 90458639 a nefunguje tam ani uplatnenie odchylky.\n\nProsim o riesenie.\n\nDakujem.'),
(932,3,'Zuzana Mendl','Ahojte, \nprosim o vytvorenie prístupov pre Zuzana Mendl, ktorá nastupuje na pozíciu Asistent podpory predaja a marketingového oddelenia od 1.10.\nref user je Marek Fecko + prístupy do Marketing a Produkty na Ztku.\nV prípade potreby detailov + sedenie sa prosím obráť na Tomáša Vasila.\n\nProsím o zabezpečenie taktiež notas a mobil.\n\ndakujem\nK.'),
(933,3,'Veronika Káčerová','Ahojte prosím o vytvorenie prístupov pre Veronika Káčerová, Brigádnik na recepcii.ref user Frederika Knapíková,\nvopred dakujem\n\nK.\n'),
(934,4,'undefined','Ahojte.\n\nNefunguje pripojenie do NBS pre RBUZ3. \n\nhttps://rbuz3.univerzal-net.sk/login/?next=/\nhttps://rbuz3-test.univerzal-net.sk/login/\n\n\nProsim zjednat urgentne napravu musime odreportovat udaje. \n\nDakujem \n\nSG'),
(935,1,'Cofisun','Ahoj,\n\nNa zmluve 25772 sa nam udial mensi chaos, ktory sa nam tu neadri opravit nijakym sposobom. Totiz, klient poziadal o predcasne splatenie, avsak, dostal 50% zlavu z poplatku za predcasne splatenie, ktora nam vyskocila ako nedoplatok, co sme museli korigovat fiktivnou splatkou. Tuto sumu na uctarni rozdelili na dve casti, obe isli 30.8.2019, ale system tu druhu platbu vyhodnotil ako dalsie predcasne splatenie, co nechapeme, preco a nahodil si tam dalsi nedoplatok.\n\nPotrebovali by sme, aby vo Fr tie dve platby z 30.8.2019 pripisali ako splatku a zaroven zrusili to druhe predcasne splatenie, tym padom by mala zmluva zostat na nule.\n\nDakujem,\nM.'),
(936,1,'Ine','Ahoj,\n\nvolala klientka Anna Zausinová, tel. č. 0903 759 363, zmluva 90459828, že sa nevie dostať do klientskej zóny, aby vložila dokumenty. Príde jej len  mail, ale nepríde jej heslo do mobilu. Tel. číslo je zadané správne. Pozriete sa na to, prosim?\n\nDakujem,\nM.\n'),
(937,4,'undefined','Can you please check CF Communication in attachment - there is problem with 14.26. and 14.27. - automatic sms to sales manager. \n\nAlso please, see in attachment, there is also one case where communication was generated OK.\n\nThank you.\n\nZuzana '),
(938,4,'undefined','Dnes neviem aktualizovať report vo Webi  - Collections - Monthly paymants _P1,2,3 vyhadzuje hlášku error. Prosíme o urgent riešenie, nakolko reportom aktualizujeme platby inkasnym spoločnostiam kazdý deň. '),
(939,4,'undefined','We detected problems in references 01.486.171.101 and 01.264.247.101, please see print screen and description in attachment.\n\nZuzana'),
(940,1,'Ine','Ahojte, \r\n\r\npoprosila by som prístup pre Mišku Barabasovú a Bena na môj folder na Z-tku /Products, aby tam vedeli uložiť nejaké dokumenty... \r\n\r\nDôvod: potrebujem od nich dáta - reporty, a sú dosť veľké, aby sme si to nemuseli vymienať cez maily. \r\n\r\n\r\nĎakujem \r\n\r\nLucia'),
(941,1,'Ine','Ahojte, \r\n\r\nticket cislo : 940 bol uzavretý, ale Miška ani Ben tam nemajú prístup. Prosím ešte raz nastaviť prístup. \r\n\r\nĎakujem \r\n\r\nLucia'),
(942,2,'Notebook','Ahoj. \n\nProsim dat Zuzke Hlivarovej NTB namiesto PC. Ziadost bola schvalena Martinom koubekom. \nZuzka ma Visio a standardnu instalaciu.\n\nDakujem \n\nSG '),
(943,4,'undefined','Ahojte, chcela by som sa spytat v akom stadiu je elektronicke schvalovanie faktur? Je vsetko technicky zabezpecene? Chceli by sme zaviest, aby sa faktury schvalovali elektronicky. Dakujem'),
