(945,1,'Cofisun','Hello, \n\nwe had some clients in external agency MABORO because of process recovery of receivables. After release of cofisun 17th of September  we didnt have in synthesis information about advisor - there is nothing although these clients are under advisory od MABORO, they are in ventilation under MABORO. \n\nCan you please check it and repair it. \n\nThank you very much. \n\nOn following contracts is missing advisor in heading and also in synthesis: \n\n22123\n22707\n23751\n24053\n24304\n24454\n60012483\n60012483\n\n\n\nOn folowing contract we can see advisor in heading information about client but there is no information about advisor in synthesis:\n25612\n60020558\n60022778\n23443\n25702\n25016\n24759\n20350\n21165\n60025811\n20218\n17263\n50041997\n18059\n25766\n24349\n23659\n19592\n19824\n22188\n23702\n\n\n'),
(946,1,'Cofisun','Ahojte,\n\nzacali sa nam vracat emaily zaslane klientom z eisecu ako nedorucitelne. Posielam v prilohe aj s prislusnou hlaskou. Jedna sa o fyzicke osoby, ale je mozne ze sa jedna o nejake pravidlo povolenych adries (azet, post...)\nPri zmluve 24431 a 21431 klient s nami komunikoval cez tuto email. adresu v 08/2019, takze by mali byt funkcne.\nMohli by ste prosim preverit, ci aktualizaciou neboli nastavene nejake nove pravidla ?\ndakujeme'),
(947,2,'Tlaciaren','Ahojte,\n\nTlaciaren tu u nas - blok B, nam vypisuje, ze docahdza toner. Asi by ju bolo treba precistit a vymenit toner, prosim.\n\nDakujem,\nM.'),
(948,1,'Cofisun','Ahojte,\n\nv eisecu mi chyba opravnenie na aktualizaciu kontaktov na klienta pre pravnicke osoby. Chyba mi tam pridanie a vymaz kontaktov v zalozkach: detailné údaje o rozpocte, bankové účty, kontakty a tretie osoby. Tieto opravnenia maju bezne referenti spravy pohladovak, zrejme sa jedna len o pridanie poolu.\nV prilohe uvadzam ako sa dostavame do konkretnych zaloziek a aktualny a pozadovany stav.\n\ndakujem'),
(949,1,'Cofisun','Ahojte,\n\nmáme schváleného klienta na CKL a po schválení mu prišla SMS o zamietnutí.\n\n01.019.110.101\n40000938\n'),
(950,1,'Cofisun','Ahojte,\n\npodľa dostupných informácií obchodným zástupcom nechodia SMS o schválení/odložení/zamietnutí žiadostí. Malo to byť implementované s novou verziou.'),
(951,1,'Cofisun','Ahojte,\n \nvcera nam volali vo vecernych hodinach klienti, ktori obdrzali SMS s pripomenutim uhrady, ale timto klientom sme ziadne SMS neposielali. Podarilo sa mi ziskat textaciu a viac info od jedneho klienta, tak to blizsie aj s printscreenom uvadzam v prilohe.\n\nZ vymahania odchadzali sms na zmluvy 22142 a 22442, ale odislo to na telefonne  cislo na zmluve 23202 (splateny uver), toto cislo pri tych zmluvach nebolo vedene a manualne nevieme modifikovat cislo pri odosielani, detail v prilohe. Prosim preverit, klienti boli nahnevani.\n\ndakujem'),
(952,4,'undefined','Ahojte, po vymene notebooku sa vyskytla chyba v Heliose  - vid priloha a nedostavam spravy cez skype. Prosim o vyriesenie problemu. Dakujem'),
(953,4,'undefined','I would like to ask you to check Car Financing communication that was implemented with the last version of EISEC.\n\nPlease, see the table in attachment and print screens of some demands. You can find there categories and subcategories of communication in demands where it worked ok, demands where it didn´t work correctly or not at all. \n\nThank you in advance.\nZuzana'),
(954,4,'undefined','Aktuálne v produkcii v parametroch nie je nic take ako dovod alebo typ odmietnutia - da sa aby nam do automatickej sms pre OZ dotiahlo aj dovod zamietnutia? Resp. prosím o vytvorenie parametra pre typ odmietnutia. \n\nV prílohe posielam výstrižky z FS - ako samostatný parameter to nie je uvedené, je to ale v textácii novej komunikácie na OZ ako \"reason of refusing\".\n\nĎakujem.\nZuzana '),
(955,4,'undefined','Ahojte Chalani\nprosim Vas, Martin nedokaze volat cez skype, pozriete sa mu na to?\n\ndakujem\n\nMaja'),
(956,1,'MicrosoftOffice','Ahojte,\n\nmohli by ste nam tu na controllingu nainstalvat access.\n\nVdaka Lucke sa tu chystavme na velke zmeny ;-)\n\nDakujem!'),
(957,1,'Cofisun','Ahojte,\n\nmám tu takú vec, žiadosť je na živnostníka na IČO a teda keď si dám zložku vyhľadať, tak sa tvári v tej prvej obrazovke ako prebieha, pritom keď vojdem do žiadosti je odmietnutá. Stornoval to predajca cez extranet. Mám informáciu, že žiadosť je stále v úverovom registri ako rozpracovaná.'),
(958,4,'undefined','Ahojte.\n\nProsim urgentne vyriesit problem s RBUZ3 \n\nNejde opat pripojit na adresu \n\nhttps://rbuz3.univerzal-net.sk/\n\nS pozdravom \n\nSG'),
(959,4,'undefined','Can you please check communication 14.26. (automatic sms to sales manager) - in reference 01.498.626.101 it was generated in error, see print screen in attachment.\n\nWe added parameter for Company name into this communication - can it be the reason why it ended in error?\n\nThank you in advance.\n\nZuzana '),
(960,1,'Cofisun','Ahojte, novou aktualizáciou systému sa niečo zmenilo aj v pomenovaní polí v Extranete? Pretože sa nám množia žiadosti na právnické osoby (szčo aj firmy), kde je namiesto obchodného názvu priezvisko živnostníka, v prípade sro priezvisko ručiteľa. Pred aktualizáciou to nerobilo.'),
