(962,1,'Cofisun','sms na obchodných zástupcov - sms informácie o zmluvách sa zasielajú, ale EISEC si pamätá, že v minulosti, konkrétne 09/2018 bol partner pridelený pod iný región, v roku 2019 nastala zmena regiónu, ale EISEC má v pamäti pôvodný región a sms chodia obom obchodným zástupcom -  potrebujeme vedieť kde to máme zmeniť, prepnúť, vymazať, aby sms boli zasielané len na jedného, aktuálneho obchodného zástupcu'),
