(1024,1,'Cofisun','Ahojte,\n\nMame tu dalsi problem s PN, pisem rovno anglicky.\n\nDakujem,\nM.\n\nThe client, contract number 90263519, had a conditioned zero contract, received 1559 euro. The client paid 1 payment 47,10 euro and 17 times 45,74 euro, then paid the remaining 734,32 euro, which totals 1559 euro. The conditioned zero ran properly on the 17th, however, the system calculated an overpayment of 87,82 euro. Can you explain where this overpayment is from, please? The client paid back the whole amount that was financed, did not pay us more, yet, there is still an overpayment which we cannot identify. Thanks for your help.'),
