(1040,3,'Martina Kormošová','Ahojte, poprosim Vas vytvorit pristup do Multicashu pre kolegynu Martinu Kormošovú. Mala by mať tie isté práva ako Pali a Tonka (podpisovanie na odoslanie platby k užívateľom s právom podpisovania a odoslania do banky). \n\nNežiadajte prosím prístup k účtu SK31 1100 0000 0020 0901 0693 !\n\nĎakujem'),
(1041,1,'Cofisun','Ahoj,\n\ntestovala som predchadzajucu poziadavku 1002, ktora uz je uzatvorena a teda zistili sme, ze kalkulacka v Eisec nespravne pocita budget. Uz mi to nezamietlo automatom, ako povodnu ziadost v poziadavke 1002, ale budg nie je spravne vypocitany. Posielam v prilohe chyba kalkulacie rezervy.'),
(1042,2,'Deskphone','Ahojte,\n\ncca od jednej  hodiny sme zaznamenali problem s prichadzajucimi hovormi. Klienti sa nedovolaju do spolocnosti, preskusane na tel. cisle 02 322 220 33 (skupina vymahania), v telefone sa ozyva zvuk ako fax. Odchadzajuce hovory su v poriadku'),
(1043,4,'undefined','Hello after changing interest rate for CD we find in SAS database and also in WEBI some problems with correct interest rate for this product. \n\nIn attachment you can see two main tables cnt_fact - contract table from SAS where each CD+ product have sct_taeg_org 11,99 but whe n we look at the table sui_cnt_his_fact we see other one sct_tda = 16.9. \n\nWhy is it happend ? We have problems with reporting. \n\nAlso when we select case by WEBI application we see only new interest rate 16.9 ? \n\nHow is calculated interest for the product if client open the product in April 201904 and the interest rate was 11.99 and now we change the interest rate for new production. Interest amount is calculated with 11.99 from the opening or 16.9% ? \n\nIn attachment you can find comparison of two main tables sui_cnt_his_fact and cnt_fact - from deci_sk database. \n\n\n\nAhojte. \n\nnapisal som Vam ticket je to trosku komplexnajsia vec kazdopadne mame v databaze chybu. Ticket asi zduplikovat na dva timy na D330 (SAS) na DA40 (nech sa vyjadria z pohladu financnych kalkulacii a na tim co managuje WEBI (asi DA30 ? ) \n\nDik moc'),
(1044,4,'undefined','We find in the EISEC inconsistency of calculation interest amount after change interest rate from 11,99% to 16,9% (see in attachment) \nWe expected decreasing trend of interests because capital goes down when client pay regularly. In period 2019/09 we observe increase of interests but we don’t know why ? \nWe think that also calculation of interest changed after change of interest rate for the product in general. It is not possible because CD+ open when the interest rate was 11,99% can not be change to 16,9%. This is big legal issue. \nCan you send us formala for calculation monthly interests for CD+? \nThank you for explanation. \n\nStano'),
(1045,1,'Cofisun','Ahoj,\n\nna zmluve 40000496 Zuzka ešte pred úhradou vybrala procedúru na zápočet mimoriadnej splátky 1300 Eur, aby sa skrátila doba splácania. Úhrada prišla 11.10.2019 a úhrada sa do dnes nezapočítala. Včera zadala čiastočný zápočet znova, ale čiastka ostala nezapočítaná. Prosím, pozrite sa na to. Prípadne, ak by nám fr vedeli vysvetliť, kedy presne sa na CKL započítavajú splátky, lebo toto sa nám ešte nestalo.\n\nĎakujem,\nM.'),
(1046,1,'Cofisun','Ahojte,\n\npoprosím o priadnie tlačiarní. Keď chcem niečo vytlačiť nevidím tam naše tlačiarne, na ktoré tlačíme.'),
(1047,4,'undefined','Ahoj Stanko,\n\nako som Ti spomenula, dostali sme od spolužiadateľky pri zmluve 50047289 podklad pre výpočet schopnosti spotrebiteľa splácať úver. Formát nechám na Teba, či to bude kalkulačka v Exceli, ale vzhľadom na to, že by sme chceli poslať odpoveď listom, tak by som preferovala vzorec a vstupné dáta.\n\nDôležité body, ktoré, prosím, urob:\n1. pozri sa na dokumenty, ktoré máme doložené;\n2. pozri na úverové správy / potvrdenie zo SP a vstupné údaje počítané pri výpočte budgetu;\n3. prosím, aby bola kalkulácia pripravená 100% v súlade so zákonom\n\nPotrebujeme to čo najskôr, vzhľadom na to, že v žiadosti od klientky je toho viac.\n\nĎakujem.\n\nB.'),
