(1056,1,'Ine','Ahojte,\r\nnefunguje mi volat cez Skype, adresat vidi ze mu volam, ale nepocuje ma a po kratkej chvili mi cely Skype zamrzne'),
(1057,1,'Cofisun','Ahoj,\n\nJozefovi nejde zadat hromadny komentar, neviem dolozit dokaz, nakolko mu nevypise nic, len proste system neberie vlozenie komentara na vedomie.\n\nPozriete sa mi na to, prosim?\n\nDakujem,\nM.'),
(1058,1,'Ine','Ahojte,\n\npotreboval by som nainštalovať tool CC supervision.\n\nZdeno'),
(1059,4,'undefined','Ahojte, vyskytol sa znovu problém s podpisom za Cofidis - V prílohe posielam print screeny + popis nižšie:\n\nZmluvy 90467628 a 90464399 sú z eshopov, kde klient zvolil elektronický podpis - zmluvy boli z našej strany spracované a nachádzajú sa v archíve, podpisy klienta sú na všetkých dokumentoch, ale chýba podpis za Cofidis - prosím o preverenie a riešenie.\n\nZmluva 90473634 je z kamennej predajne, kde klient zvolil elektronický podpis - zmluvy podpísané z klientovej aj zo strany Cofids, nachádzajú sa v archíve, ale na Informácií o spracúvaní osobných údajov chýba podpis klienta - prosím o preverenie a riešenie.\n\nĎakujem.\nZuzana'),
(1060,4,'undefined','Ahojte. \n\nProsim zadat poziadavku na WEBI tim tusim DA20 Julien David je manager resp na tim ktory manazuje hierarchiu partnerov. Po zmene hierarchie sa rozhadzali a zle sa dotahuju partneri do reportov vo WEBI, Zatial preverujeme este SAS - databazu. Dopad to moze mat aj na provizne liste a na dalsie reporty.\n\n\nHello. \n\nafter implementation hierarchy in EISEC, we observe change in WEBI reports. Screen Report. For all demands / contracts we can see Partner as COFIDIS GRUOP and PArtner Direct Opening the branch not the Partner. \n\nBefore change it was correct Partner was e.i. AUTOCENTRUM AAA AUTO and Partner direct opening was AAA AUTO B.BYSTRICA.\n\nNOW it is incorrect because partner is also AUTOCENTRUM AAA AUTO (not COFIDIS GROUP) and Partner direct opening was AAA AUTO B.BYSTRICA.\n\nCan you say us what is  happend ? And How we can change it ?\n\nThank you'),
(1061,1,'Cofisun','Ahojte,\n\npotrebovali by sme preverit pripisanie platieb. V poslednej dobe nam chodia notifikacne emaily o integracii  v pocte tri a viac. Vcera a dnes sme zatial obdrzali iba jeden.\nDnes mame predvstupnu kampan, potrebovali sme mat vsetky platby nahrate\n\ndakujeme '),
(1062,1,'Cofisun','Ahojte,\nmohli by ste, prosím, požiadať EI o urýchlenie spracovania storna financovania na zmluve 90442087?\nPotrebujeme, aby sa storno financovania započítalo s dnes odfinancovanými zmluvami pre partnera Global-tex.\nPre tohoto partnera financujeme zmluvy len občas, a už sme dosť dlho čakali, kým mu budeme financovať zmluvy v dostatočne vysokej sume.\nĎalším čakaním by sme klienta ešte viac poškodili.\nVopred ďakujem.\nTonka'),
(1063,2,'Ine','Ahojte,\n\nbuduci tyzden 31.10. od 9.tej hodiny ma odd. pohladavok  skolenie v zelenej zasadacke.\nChcela by som Vas len poprosit, ci by ste boli k dispo skolitelovi, ak by potreboval so zapojenim.\nVopred velmi pekne dakujem '),
(1064,1,'Ine','Ahoj, radšej otváram ticket, ale už mi to niekoľkokrát riešili. \nM:ZONE - dali mi prihlasovacie údaje, tak som sa prihlásila na svojom PC a zobrazil sa ERROR. nevedia sa dostať k zoznamu žiadostí. Ak bude treba, dám ich prihlasovacie údaje '),
(1065,1,'Cofisun','Ahojte,\n\nv Eisecu mame zamietnuty CKL, ale v stave ziadosti sa zamietnutie neprejavilo. Prosim o preverenie.'),
(1066,1,'Cofisun','Ahojte,\n\nmame  chybu v spracovatelskom poplatku u webpartnera (extranet). V Eisecu a na zmluve je to v poriadku, ale u obchodneho partnera je ina ciastka. Cislo zmluvy 50105707, referencia 01.519.400.101.'),
(1067,1,'Ine','Ahojte, prosím, aby mal Juraj Kantorek v rámci pošty outlook prístup aj do   priečinka pravnevymahanie@cofidis.sk\n\nďakujem'),
(1068,1,'Ine','Ahojte, \nveľmi pekne prosím, aby ste Jurajovi Kantorekovi nainštalovali všetky programy na obsluhovanie e-schránky ako má B. Demeterová, otváranie, sťahovanie, zasielanie pošty, ako aj súbor na otváranie súborov asice. \n\nďakujem veľmi pekne. \n\nplus zároveň prosím, aby Juraj Kantorek mal aj v rámci outlooku prístup aj do pravnevymahanie@cofidis.sk\n\nďakujem veľmi pekne\n\n '),
(1069,1,'Cofisun','Ahojte, nejde mi vobec sa prihlasit do CofiSunu. Ani cez Mozzilu ani cez Internet Explorer. Surne v nom potrebujem robit. Dakujem\n\nZuzana'),
(1070,4,'undefined','Ahojte, chcela by som vas poprosit, aby ste skontrolovali, ci maju kolegovia v zozname nainstalovany Helios. Tym kolegom, ktori nemaju, nainstalujte ho prosim s priradenim prav iba k fakturam na prehliadnutie (posielam v prilohe). Dakujem '),
(1071,1,'Ine','Ahojte, \r\n\r\nchcem vás poprosiť o zmenu nastavenie pre  \\\\uf61sb03\\COMMERCIAL\r\n\r\nteraz mám povolené len na čítanie, potrebujem aj na zapisovanie. \r\n\r\nĎakujem \r\n\r\nLucia Oravcová '),
(1072,1,'Cofisun','Ahoj...preposielam problem od Zuzky H. Prosim, pozrite sa na to. Dakujem! M.\n\n\nprílohu s názvom almasy som sa snažila preposlať do Cofisunu cez informácie do TO DO LISTU. Skúšala som poslať ako .jpg súbor aj ako .pdf súbor, ale príloha sa mi žiaľ nezobrazila. Keď som to poslala ako jpg, bolo vidno len šedú stránku. Keď som poslala ako pdf súbor, tak mi prílohu ani neukázalo. Prílohy s názvami Snímka sú toho dôkazom.\n\n\n'),
(1073,4,'undefined','Ahojte, mohli by sme prosim dostat pristup do CV4? Uzivatelia: Agh, Ivan, Zabojnikova, Koromosova\nDakujem'),
(1074,1,'Ine','Ahojte, \n\nMartinovi Geschvandtnerovi u nas zmizli nainstalovane tlaciarne. Prosim pridete mu ich opat nastavit?\n\nDakujem'),
(1075,1,'Cofisun','Dnes neprišli maily ma pohladavky k nahratým platbám v Eisecu. Nikto z nás nemá platby v todo liste. Prosíme o doriešenie. '),
