(1077,1,'Cofisun','pri zásahoch do cenových tabuliek sa nám mení výška spracovateľských poplatkov, pri VICTORY MERGENCE nie je 2,60 % ako je nastavené, ale 3,00% a pri AAA nie je 3,25%, ale 3,00%, potrebujeme to mať napevno, aby sa to viac neopakovalo, prikladám aj prinscreen'),
(1078,1,'Cofisun','Ahojte,\n\nMame tu taky problem, ze klient si bral tovar na splatky, do zmluvy nezadaval spoludlznika, ale v systeme mu tam prihodilo spoludlznika. Nakolko to bolo cez extranet, ziadost sme nenahadzovali my, cize netusime, ako sa toto mohlo stat. ja ani neviem, ci to vlastne je na ticket, ale viete sa na to pozriet, prosim?\n\nDakujem :)\n\nM.'),
(1080,4,'undefined','Ahojte, prosím o zistenie informacie:\n\nPotrebujem potvrdiť, že sa poistenie automaticky nevypovie po dosiahnutí veku 75 rokov v prípade, že má klient súbor poistenia SENIOR (v súbore SENIOR je to rozdelené – smrť poisteného, ktorá nastane do veku 75 rokov bez ohľadu na príčinu a potom je tam náhodná smrť poisteného, ktorá nastane do veku 85 rokov.\n\nVopred ďakujem.\n'),
(1082,2,'Tlaciaren','Ahojte,\n\nMoje baby mi hlasia, ze je nejaky problem s tlaciarnou, ze sa neda ani kopirovat, ani scanovat. Pozriete sa na to, prosim?\n\nDakujem,\nM.'),
(1083,4,'undefined','Na tlaciarni nefunguje scenovanie na mail. Tlacitko je stale sive. Aktualne prebieha aktualizacia tlaciarne. Prosime opravit prihlasenie  do tejto tlaciarne, kde sa neda prihlasit hned ale na 3x s prihlasenim cez kartu. '),
(1084,4,'undefined','Ahojte, \n\nmáme problém s multifunkčným zariadením, nefunguje nám skenovanie, skúšali sme viacerí. \n\nProsím môžete sa pozrieť, či je problém v nejakých nastaveniach a pod, \n\nďakujem pekne. \n\nbd'),
(1085,1,'Ine','Ahojte,\n\npoporosim o vymenu sluchatkovecho kabla pre Brana Ilavskeho. \n\nDakujem'),
(1086,1,'Ine','potrebujem vygenerovať marketingové listy, píše mi tam, že no data'),
(1087,4,'undefined','Potrebujeme zastavit posielanie automatickeho emailu 16.3. pri produkte CofiKlasik.\n\nEmail by mal byt klientovi posielany aj so zmluvou v prilohe, ale zistilo sa, ze priloha sa neodosiela. Opatovne by sa email spustil az po vyrieseni problemu s odosielanim prilohy.  \n\nDakujem.\nZuzana'),
(1088,1,'Ine','Ahoj,\n\nmame tu opakujuci sa problem, nakolko nemame pdf creator, klienti sa nam stazuju, ze im nejdu otvorit nase zaheslovane zmluvy. Nedalo by sa s tym nieco robit, prosim? Uz sme sa naucili heslovat inak, nez cez pdf creator, my si to aj vieme otvorit, ale mnohym klientom to nejde. V prilohe dnesny klient.\n\nDakujem,\nM.'),
(1089,4,'undefined','Ahojte,\npri importe dnešného súboru s financovaním do multicashu, mi multicash opäť hlásil chybu pri čítaní importného súboru.\nSúbor sa nedá ani otvoriť alebo natiahnuť do excelu.\nProsím o zaslanie žiadosti o opravu importného súboru vo FR.\nDo komunikácie pridajte, prosím, aj Martina Koubeka.\nVopred ďakujem.\nTonka'),
(1090,1,'Cofisun','Ahojte,\n\nvčera volal klient na CC a informoval sa na dôvod zamietnutia. Pozrela som to a podľa mňa zamietnutie nebolo správne. Zamietnutý bol automatom na rozpočte. Prepočítala som mu rozpočet a úplne v pohode vychádzal. Posielam v prílohe prepočet našej kalkulačky aj kalkulačky v EISEC, Rozpočet som rátala bez ostatných príjmov. klient Michal Pavlík, 01.524.930.101'),
(1091,4,'undefined','Ahojte, auditori ziadaju, aby sme predlozili aktualny telefonny zoznam pracovnikov. Poslite, ho prosim do 14.11.2019. Dakujem'),
(1092,4,'undefined','Ahojte, tento tyzden nam ide excel velmi pomaly. Mrzne, pomaly sa otvaraju subory, neukladaju sa. Mohli by ste prosim preverit aky moze byt problem? Dakujem'),
(1093,3,'Tiyo','Ahoj Jurko\n\nprosim o objednanie novej SIM s novym cislo na pre DJANKLA Tiyo \npausal: Nekonečno v SR, v EU do EU \n\nEste dnes prosim napis Beresovi, daj ma do kopie prosim\n\nDakujem\n\nMaja'),
(1094,4,'undefined','Ahojte,\nvedeli by ste, prosím, vytiahnuť zálohu súboru  Reserve_2019, ktorý sa nachádza na adrese Z:\\Zavierka\\Reserve\\2019 k dátumu 7.11.2019?\nNa tabuľke robím už od včerajšieho rána a dnes som tam našla zmeny, o ktorých nemám vedomosť, že by som ich vykonala.\nPodľa tej tabuľky musím účtovať do závierky za mesiac 10/2019 a termín je dnes.\nVopred vďaka.\nTonka'),
(1096,4,'undefined','Hello.\n\nPlease change result of the xue_35124 to Comp. Cofidis from REFUSE in all product trees. CD+ / NT / AUTO FO and CKL. \n\nThank you \n\nBest regards\nSG\n\nDajte ma prosim do sledovania SARA ticketu - dakujem '),
(1098,4,'undefined','Ahojte,\n\npotreboval by som povolenie na úpravu nie len na čítanie v zložke \\\\Uf61sb03\\vnutorne_predpisy, pre:\n\nZdenko Hrabovský\nZuzana Hlivarová\n\nĎakujem veľmi pekne\n\nZdeno'),
(1100,4,'undefined','Prosim o opravu vysky splatky v EISECu v nasledujucich zmluvach:\n\n90476184 - contract 10,68 / eisec 10,69\n90472515 - contract 104,24 / eisec 104,26\n90473467 - contract 26,91 / eisec 26,93\n90470191 - contract 15,07 / eisec 15,08\n90476671 - contract 13,67 / eisec 13,68\n90476608 - contract 34,26 / eisec 34,30\n90471362 - contract 94,19 / eisec 94,28\n\nDakujem.\nZuzana'),
(1102,1,'Ine','Ahoj,\n\nPodla dohody zadavam ticket, UREC za dnesny den nenahral ani jeden hovor, vid prilohy. Prosim, pozrite sa mi na to, potrebujem to faj urgentne.\n\nDakujem,\nM.'),
(1103,4,'undefined','Ahojte,\nprosíme o zazalohovanie 1polroku 2019 mail: finance1@cofidis.sk\na taktiez spristupnit archív finančnému oddeleniu.'),
(1104,1,'Cofisun','Ahojte, pri N-timesovych uveroch sa nam stava, ze nam tam vyskoci okno \"NESPOJITOST UDAJU ZE SEZAMU\" . Da sa tento zoznam nejako vypnut, ide o nastavenie, ktore sme prebrali z CR. Predajcovia mali v minulosti moznost zadavat vydaje zvlast, cize ked predajca vypisal, ze klient ma formu byvania vlastnik s hypotekou a do rozpoctov nedal hypoteku, tak vyskocilo toto upozornovacie okno. Dnes uz sa rozpocty detailne nevypisuju, pretoze vydaje ratame z uveroveho registra, ale tieto kontrolne okna nam stale vyskakuju. Vo viacerych pripadoch, keby tam toto upozornenie nie je, by mohla byt ziadost posudena automatom. Takto to musime manualne odkliknut a az potom sa urobi rozhodovaci strom. '),
(1105,1,'Cofisun','Ahojte, denne mame niekolko pripadov, kedy sa nepreklopi zamestnavatel z extranetu do eisecu pri N-timesovych ziadostiach. Mam informaciu od kolegov, ze sa to deje, ked je nazov zamestnavatela prilis dlhy. Ked sa nam takato ziadost dostane do eisecu, musime tam rucne doplnat zamestnavatela. Zdrzuje to proces posudenia, kedze doplnit zamestnavatela zaberie dost casu. A tiez ak by to bolo doplnene z extranetu, tak ako to ma byt, niektore ziadosti by boli posudene automatom.'),
(1106,1,'Ine','Ahojte,\n\npotebovali by sme pomoct s reisenim problemu heslovania pdf zasielanych klientom. Po obnove PC/NTB nemaju poradcovia nastroj na heslovanie PDF. Aktualne su dokumenty komprimovane do ZIP suborov. Tieto vsak nemaju rovnaky standard, existuju rozne aplikacie na kompresiu a rozbalovanie ZIPov co sposobuje, ze klienti maju problem s otvaranim suborov najma v smartfonoch\n\ndakujem\nbr\n'),
(1107,1,'Cofisun','Ahojte,\n\nposlednych par dni nam eisec seka a ma spomalene reakcie.\nViete sa prosim na to pozriet, hlavne pri hovore s klientom nam to komplikuje zivot\n\ndakujeme'),
(1108,1,'Ine','Hello,\n\nreports of Collection from Webi are not refreshed. For report P2 and P3 active weekly closing are missing data from last weekly closing and for reports from previous weekly closing, this report was not changed and there are missing last payments from yesterday.\nIs it possible to refresh them please ?\n\n\nAhojte,\n\nzda sa, ze po release nezbehli uplne korektne reporty. Potrebujem hlavne reporty \"Contracts in P2 for previous weekly closing\" a \"Contracts in P3 for previous weekly closing\" nakolko to je koncomesacny vysledok vymahania.\n\ndakujem'),
(1109,1,'Ine','Ahoj,\nešte stále nemám v novom PC nainštalovaný program EI file protection.\nProsím o doriešenie.\nĎakujem.\nB.'),
(1110,3,'Jana Galffyova','Ahojte,\n\npotrebovala by som pristup na zapis do:\n\n\\\\uf61sb03\\VNUTORNE_PREDPISY\\_Zoznam vnútorných predpisov\n\n\ndakujem'),
(1111,4,'undefined','Ahojte, v niektorych pripadoch sa Branovi Ilavskemu stava, ze mu vyskoci hlaska na PDF subor, ked ho chce otvorit. Po tejto hlaske mu uz nejdu otvarat PDF subory a musi si restartovat pocitac, aby mu opat nacitavalo PDF subory.'),
