(1118,1,'Cofisun','Ahojky,\n\nCuduj sa svete, zasa tu mame problem s PN...tento raz je to nespravne vygenerovana vyska preplatku, pisem rovno in English :)\n\nContract - 90282652\nFinanced amount - 549 eur\nConditioned zero ran and interest was annuled 17.06.2019\nClient continued payments and altogether paid - 860,58 eur\nActual difference between financed and paid - 311,58 eur\nOverpayment in EISEC - 290,58 eur\n\nCan you explain, please, why the system calculated a lower overpayment than it was supposed to? We need to return the overpayment to our client in the actual amount, but cannot do so at the moment.\n\nDakujem,\nM.'),
(1119,4,'undefined','Pri zmluve 90480486 sa neda spracovat financovanie. Pri pokuse zmluvu odfinancovat sa zobrazila informacia o nespravnom rodnom cisle klienta - udaje skontrolovane podla dolozeneho obcianskeho preukazu a su spravne. \n\nV prilohe screenshot.\n\nProsim o riesenie.\n\nDakujem.\nZuzana'),
