(1125,1,'Cofisun','Ahoj,\nMame tu problem s touto zmnluvou, klient zaplatil vsetky splatky a stale ma dlh, posielam rovno anglicky.\nDakujem,\nM.\n\nKlient paid 30x 19,83 euro as stated in welcome letter. All positions 1. Paid all installments according to the instructions and should be on zero, however, there is still debt 5,30 euro. How is this possible?'),
(1126,1,'CV4','Ahojte chlapci.\ndna 19/11/19 boli do Eisecu nahraté úhrady poštovu poukazkou - stare za 18/11/19.\nTeraz tam su duplicitne uhrady z 18/11/19 a chýbajú 19/11/19.\nProsím o zrušenie duplicity a dohratie platieb z 19/11/19\nPavol IVAN'),
(1127,1,'Cofisun','Hello,\nDalsi divny pripad, kde system bez ocividneho dovodu ocakaval dvojnasobnu splatku od klienta, takze klient po zaplateni riadnej splatky isiel do vymahania. Konzultovane s Jankou, tiez mi potvrdila, ze to bolo neopravnene. Prikladam popis v anglictine a v prilohe rozklal splatok.\n\nDakujem,\nM.\n\nKlient is paying all his installements as instructed, yet, for no apparent reason, the system calculated an expected payment of 12,35 euro this month, so when the client paid his regular payment, he went into collection. Can you please, explain why this happened? The case was discussed with collection department and we didnt come to any conclusion, except that it was wrongly calculated.\n'),
(1128,1,'Ine','Ahojte,\n\nmáme problém z reportami vo WEBI, kde sa nám nezobrazujú žiadosti CD+ a CKL od 13.11.2019.\n\nIde o žiadosti v universe Suivi commercial.\n\nNázorný report zasielam v prílohe.\n\nZdeno'),
