(1149,4,'undefined','Ahojte, \n\nchcem poprosit o riesenie situacie, ktora sa opakovane stala M. Bobulovej (akceptacia), popis nizsie:\n\n- 26/11 jej o osmej večer vypadol EISEC a nemohla ho zapnut 45 minut (screenshoty obrazovky v prilohe)\n- to iste sa jej stalo aj v pondelok 25/11 rano\n\n- odpaja ju to od systemu - system jej zamrzne a potom sa neda ani zapnut. \n\nZatial mam hlaseny problem iba u tohto uzivatela.\n\nDakujem.\n\n\n\n'),
(1150,1,'Cofisun','We would like to adjust our reporting in WEBI in regard to N-times product. We provide client a credit line, which client can draw via several financing  - what we can see in the print screen from Cofisun as a contract 001 and 002 (see printscreen). Each financing has a different interest rate, different duration, different amount. Our standard product reporting from webi (from universe suivi des contracts) does not enable us to see the one contract 90414497 in two rows with different information for each financing (001 and 002). We see it only in one row, where the amount is cumulated. We would like to see each financing from the credit line 9090414497-001 and 90414497-002 in a separate row in webi. Could you please help us and navigate us in webi, how can we join the data, probably from more universes, so we are able to see the information for each financing separately. \nAdditional question would be, can we find in webi the information about the interest rate for each financing  9090414497-001 and 90414497-002?\n\n \n\n\n\n'),
(1152,4,'undefined','Ahojte,\n\nprosim o vytvorenie adresy sales@cofidis.sk pre skupinu uzivatelov: Zuzana Mendl, Erika Magulová, Marcela Juríčkova\n\ndakujem\nd.'),
(1153,4,'undefined','Hello,\n\nwe would like to verify the rule about charging the collection fee 20€ for product Cars.\nThere is main rule that fee is charging when position was changed from P1 to P2.\nBut we have contract 16545 where the fee was not charged. The last  entry to the collection was on the 11th of October, but on the 30th of October the fee is missing (see atachment fee_2). Is it because client paid total due before monthly closing ? is there some rule like this ?\n'),
