(1156,1,'Cofisun','Ahojte,\n\nna zmluve 60061726, bola vypocitana zla vyska splatky a tym padom aj celkovej sumy splatenia (vid príloha, kde zasielam aj kalkulacku aka by mala byt spravna mesacna splatka).\n\nIde o pripad kde bola predajcovi vratena ziadost o upravu parametrov. Partner zmenil parametre ziadosti (vysku uveru a dobu splacania), ale potom nam v EISECU bola vypocitana zla mesacna splatka.\n\nPoprosim o opravu mesacnej splatky na sumu 329,03 EUR a celkovu ciastku k zaplateniu (11845,08 EUR = 329,03 EUR x 36 mes.).\n\n\nZdeno\n'),
(1157,1,'Multicash','Ahojte,\nv piatok večer 29.11.2019 som mala problém odoslať platobný súbor z multicashu. Volala som  na helpdesk do TATRA BANKY, podľa inštrukcií o zamestnanca helpdesku som skontrolovala všetky nastavenia, ktoré boli v poriadku, ale aj tak sa mi súbor nepodarilo odoslať.\nPo prihlásení sa pod svojim menom na inom počítači, som súbor odoslala.\nProsím o preverenie, prečo som nevedela súbor odoslať.\nVopred ďakujem.\nTonka'),
