(1168,1,'Ine','Ahojte, mame schvalenu ziadost n-times. Ide o elektronicky podpis. V elektronickom podpise ale zmluva nejde podpisat. Chyba pri zmluve ikona s perom. Ziadost sme aj skusili vratit klientovi, nech nam ju posle opat, aj tak urobil, ale stale to nejde. Prosim o doriesenie. Ide o zmluvu cislo 90486957, klient Peter Mäsiar. V prilohe posielam ako to vyzera u klienta a ako to ma vyzerat.\n\nDakujem'),
