(1179,4,'undefined','Ahojte.\n\n prosim o zrusenie disk space na \\\\Uf61sb03\\cofsrsq - moze sa vymazat, je to na internom servri u nas.\n\nProsim zadat ticket na vytvorenie zlozky na servroch UKJAP001  a UDJAP001 s nazvom Sharereports_SK manazment prosim dat na mna - t.j. aby som vedel pridavat opravnenia.  Do tychto zloziek musi vidiet SAS je to pre ucely automatizovaneho reportingu. \n\nS pozdravom \n\nSG \n\n'),
