(1181,4,'undefined','Ahoj,\n\nv rámci riešenia reklamácie zápisu v SRBI Vás žiadam o požiadanie o vytiahnutie dát k zamietnutej žiadosti. \n\nIde o žiadosť na meno: Vladimír Bartoš, nar. 23. 08. 1981 zo dňa 21. 09. 2016 - žiadosť bola zamietnutá. Je možné, že boli aj 2 žiadosti vytvorené.\n\nPotrebujem:\n\nčíslo žiadosti\npartnera, ktorý dané žiadosti vytvoril.\n\nĎakujem.\n\nB.'),
