(1193,1,'Cofisun','Ahojte,\n\nna zmluve 60059342 (01.532.151.101), bola vypocitana zla vyska uveru, vyska splatky a tym padom aj celkovej sumy splatenia (vid príloha, kde zasielam aj kalkulacku aka by mala byt spravna mesacna splatka, vyska uveru a celkova ciastka k splateniu).\n\nIde o pripad kde bola predajcovi vratena ziadost o upravu parametrov. Partner zmenil parametre ziadosti (vysku uveru a dobu splacania), ale potom nam v EISECU bola vypocitana zla mesacna splatka.\n\nPoprosim o opravu vysky uver na sumu 22200 EUR (28000 - 5800), mesacnej splatky na sumu 324.89 EUR a celkovu ciastku k zaplateniu (27290,76EUR = 324.89 EUR x 84mes.).\n\n\nZdeno'),
(1194,1,'Cofisun','Ahojte, kolegom Martinovi, Bei a Patrikovi nefunguje EISEC. Skusili aj restartovat PC a stale nenabehol.'),
(1195,1,'Cofisun','Hello,\n\nWe have the same balance of the prefinancing for Quadmoto and LD Development into COFISUN. I have checked with the sales department and the accounting department, no prefinancing has been sent to the partner LD Development. the balance for LD development should be 0.\n\nWe would like to correct it and also find the source of the issue.\n\nThank you,\n\nBenjamin'),
(1196,4,'undefined','Hello.\n\nRegarding CF communication - categories and subcategories 14.7., 14.8. and 14.9. (E-mails to dealer) - we need to check the settings for sending this type of communication, because to this day, this type of communication has never been sent.\n\nPlease, see the description with screenshots in attachment.\n\nThank you.\nZuzana'),
(1197,4,'undefined','Ahojte, \r\n\r\nchcem vas poprosiť, je možné zo strany EISECU premenovať teraz vytvorené nové akčné kody pre NTIMES? \r\n\r\nPri nahadzovaní do NTIMESového Extranetu sme zistili, že tam je ohraničený počet miest pre akčný kód a to je 8 miest. \r\n\r\nnové akčné kody, ktoré boli vytvorené majú viac miest. \r\n\r\nV prílohe posielam vytvorené akčné kódy a vedľa nový popisok. \r\n\r\nak je možné ich premenovať v EISECu bolo by to super, ak nie. Tak potom musíme požiadať o uzavretie týchto a vytvorenie nových. \r\n\r\nĎakujem za preverenie. \r\n\r\nLucia'),
(1198,4,'undefined','Ahojte, \r\n\r\nna základe dnešného call-u vyplynulo, že je potrebné zadať RUBIS, pre obnovu poistenia na CD. \r\n\r\nKeďže boli vytvorené nové GTS pre Revolving, ACM chce aby sme ich aplikovali aj na CD. Takže by som potrebovala zadať RUBIS s požiadavkou o vytvorenie poistenia, ktoré je totožné pre NTIMES bezúčelovú časť. \r\n\r\nPrikladám výšku sadzieb + z čoho sa vypočítava. ak je potrebné ešte niečo, pls dajte mi vedieť dodám. \r\n\r\nŽltou je označená časť pre revolving. \r\n\r\nĎakujem veľmi pekne.\r\n\r\nLucia'),
(1199,3,'KANTOREK JURAJ','Ahojte\nkedze Juraj Kantorek je pracovne od 1.12. zaredny na oddeleni litigation, prosim o upravu jeho opravneni v eisec. Ako referencneho usera prosim pouzit profil Marcela Trnavska\n\ndakujem\nbr'),
