(1202,1,'Cofisun','Ahoj,\n\nPoprosim preverit, preco nam EISEC pri nahodeni ziadosti automaticky zahesloval zmluvu a nevieme sa k nej dostat, nefunguje ani rodne cislo, ako heslo.\n\nDakujem,\nM.'),
