(1204,1,'Multicash','Ahojte. Neviem co sa robilo cez noc. Rano mi nejake hlasky aktualizacii vyhodilo a nejde mi spojit s bankou. \nProsim o napravu.\nVdaka'),
(1205,4,'undefined','Ahojte, spracovavali sme klientke epodpis a po podpisani u nas zmizol podpis klientky. Vratili sme jej proces spat, aby zmluvu podpisala znovu a uz jej to nejde. Prosim o doriesenie. Zmluva cislo 90491287, ziadost cislo 282050, referencia 01.555.391.101'),
