(1207,1,'Cofisun','Ahojte, mame ziadost na schvalenie, ale po pretoceni modreho riadku nam vyskoci hlaska - vid prilohu - a nasledne nam vypne cely EISEC. Prosim o doriesenie. Cislo referencie 01.457.792.101, cislo zmluvy 60065075.'),
(1208,1,'Ine','Ahojte, dalsi pripad, kedy na nasej strane nejde podpisat epodpis. Bolo to riesene uz v ticketoch 971, 706, 1168. Aktualne ide o klienta Renata Černá 90491287.'),
(1209,4,'undefined','Prosim o riesenie problemu - zmluva 50119137 sa neda odfinancovat kvoli datumu narodenia (december 1999) - uz sme taky pripad riesili v internom tickete c. 1119 (sara ticket SA0000040058450).\n\nDakujem\nzuzana'),
(1210,1,'Cofisun','Ahoj,\n\nNa zmluve 90395566 nam zle zbehol vypocet preplatku po zbehnuti podmienenej nuly...English description below:\n\nOn contract 90395566, after the conditioned zero ran properly, the system calculated a wrong overpayment - 50,73 euro, the actual overpayment is 55,33 euro. Can we have an explanaition why, please? Thanks!\n\n\nDakujem,\nM.'),
