(1215,1,'Cofisun','Ahojte,\n\nmam dve poziadavky:\n1.) potrebujem preverit pooly uzivatela Patrik Kantorek, nakolko po uzavierke mu nie su pridelovane zmluvy. Maju byt nastavene rovnako ako ma uzivatel Andrea Remsikova.\n2.) Potrebujem odstranit uzivatela Juraj Kantorek  z ventilacie vymahania \"Ventilation des portefeuilles\".  (vid obrazok). Manualne odstranit pomocou tlacidla \"X\" neslo, uprava nezbehla ani po uzavierke, Uzivatel uy mesiac nema pridelovane portfolio/zmena pozicie.\n\n\ndakujem\n'),
(1216,1,'Helios','Ahojte.\nv prvom rade treba skontrolovať či sa im otvori Helios - priradeny v Databaze.\nv druhom rade sa prihlasit ako Admin a prejsť cez faktury-schvalovanie a preklikat.\nv tretom rade treba spravit pristup na citanie do priecinku \\\\uf61sb03\\ACCOUNTING\\_DOD_Faktury_scan_HELIOS, aby mohli otvarat v pdf faktury.\n\nMagulova,Mendl nefunguje workflow,\nAGH,Hrabovsky,Magulova,Mendl, Koubek, Kapitanova  ... nechodia mailove notifikacie.\n\nVdaka'),
(1217,1,'Cofisun','Ahojky,\n\nPoprosim spojazdnit mi EISEC cez VPN - ticket zadavam podla dohody.\n\nDakujem,\nM.\n'),
