(1219,1,'Cofisun','Ahoj, po vytvoreni a vlozeni dokumentov do Webpartnera  v zalozke \"Dokumenty na stiahnutie\" mi nejde zobrazit PDF prilohu vlozeneho dokumentu. Nejde otvorit na ziadnom PC. Vopred dakujem'),
(1220,1,'Cofisun','Ahojte, prosím o nahodenie nového vytvoreného produktu SPECIAL N AUTO FO a SPECIAL N AUTO PO, k partnerom v zozname.\nMax Com Amount bude 2000,00\nMax Com Rate bude 10,00\n\nDajte vedieť či to bude vôbec možné, nech to viem začať robiť ručne.\n\nĎakujem'),
