(1227,1,'Ine','Ahoj,\n\nVelmi surne potrebujeme vytvorit Evke Paulikovej pristup do OPTYSu, bol zadany ticket, aby mala rovnake prava, ako Jozef, ale toto jej chyba a dost to suri.\n\nDakujem,\nM.'),
(1229,1,'Cofisun','Ahojte,\n\nrobila som kontrolu ziadosti CKL a CD, ktore su uz starsie ako 30 dni a stu stale rozpracovane a pri ziadostiach prilozenych v zozname mi chyba modry riadok na stornovanie uveru. Ziadosti bolo mnohonasobne viac a pri ostatnych modry riadok bol. Su to vsetko ziadosti, ktore su u nas v systeme dlhsie ako 30 dni.'),
