(1231,1,'Cofisun','Ahoj Peťko,\n\nPosielam podľa dohody:\n\nHello,\nWe would need to recover two letters, category 5.2, which were accidentally deleted from EISEC yesterdy, 17 December from profile Eva Paulikova. Is it possible?\nThanks!\n\n\nĎakujem,\nM.'),
(1232,1,'Cofisun','Ahojte, prosim o riesenie, mame ziadosti v roznych stavoch a casoch a chyba nam modry riadok na doriesenie ziadosti. Ci uz ide o storna, o odlozene ziadosti, kde cakame na nejaky doklad, alebo N-timesove ziadosti. Vsetky maju spolocne to, ze je tam meno Andrea Zabojnikova. Nie je mozne, aby bola vo vsetkych ziadostiach a ani by v nich nemala preco byt.. Andrejka realne v tych ziadostiach nebola. \n\nPre priklad par referencii: \n- 01.546.703.101 \n- 01.549.644.101\n- 01.531.790.101\n- 01.534.037.101\n- 01.534.868.101\n- 01.535.007.101\n- 01.535.419.101\n- 01.473.492.101\n- 01.550.987.101\n- 01.555.083.101\n- 00.269.489.101\n'),
