(1235,4,'undefined','Ahojte,\nopäť dnes neviem naimportovať platobný súbor do multicashu. Opäť ten istý problém, ako v poslednom čase.\nSúbor je uložený na \\\\Upfap002\\eisec_prod_sk_transfert\\in\\CIVI\\Bank_transfert_file\nMôžete požiadať FR o opravu?\nVopred ďakujem.\nTonka'),
(1236,4,'undefined','Ahojte,\nkontrolou dokladov som zistila, že zatiaľ sme nedostali faktúru od EI za 11/2019.\nMôžete ju, prosím, vyžiadať?\nPrípadne aj iné faktúry zo zahraničia, ktoré nám zatiaľ za 11/2019 neposlali.\nZajtra musím podať DPH priznanie, tak mi to dosť súri.\nVopred ďakujem.\nTonka'),
(1237,1,'Helios','Prosím o vytvorenie foldra:\"_NEW_DOD_Faktury_scan_HELIOS\"\nKde budu Ďaľšie foldre (rok,typ FA).\nPrístup do tohto foldra - plná práva budú mať len: AGZ,IVAN,KORMOSOVA,ZABOJNIKOVA.\nPrístup na prehliadanie búdu mať zamestnanci, ktorí sú v Heliose ako schvaľovatelia. Zvyšok zamestnancov budu mat zatiaľ prístup odopretý..\n\nSchvalovatelia:\nMendl/Vasil/Koubek/Jonáš\nMagulová/Vasil/Koubek/Jonáš\nJonáš/Koubek\nMinns/Jonáš/Koubek\nJuríčková/Held/Koubek/Jonáš\nKoubek/Jonáš\nVyhnalová/Jonáš/Koubek\nHeld/Koubek/Jonáš\nVasil/Koubek/Jonáš\nŠucová/Jonáš/Koubek\nMastiláková/Djankla/Jonáš/Koubek\nKapitánová/Vasil/Koubek/Jonáš\nBarabášová/Koubek/Jonáš\nHrabovský/Koubek/Jonáš\nAgh/Koubek/Jonáš\nGrom/Koubek/Jonáš\n\n'),
