(1247,1,'Cofisun','Ahojte, k zmluve 5012082, cislo ziadosti 283814, cislo referencie 01.564.747.101 sa nevygenerovala zmluva. Ziadost som skusila este znovu preschvalit a ani tak sa nevygenerovala. Skusila som zmluvy aj dodatocne otvorit a vygenerovat, ale ani to neslo.  Erika sa skusila prihlasit aj cez webpartnera a ani tak to neslo. Prosim o doriesenie, klient caka v bazare, aby podpisal zmluvy. Hlasky posielam v prilohe.'),
