(1252,4,'undefined','Prosim o nastavenie komunikacie 14.4. (nedorucena zmluva - 1. vyzva), 14.5. (nedorucena zmluva - 2. vyzva) a 14.6. (nedorucena zmluva - 3. vyzva) - komunikacia sa momentale odosiela aj v pripade, ze zmluva bola uz prijata v systeme EISEC.\n\nPotrebujeme komunikaciu nastavit tak aby sa tato komunikacia uz neodosielala ked je zmluva prijata. V prilohe posielam screenshot.\n\nDakujem.\nZuzana\n'),
(1253,1,'Cofisun','Ahoj,\n\nMam tu problem v despoole, ked posielam listy, mali by sa otvorit na nahlad, ale vypisuje error, posielam aj v anglictine.\n\nDakujem,\nM.\n\nI have a problem when generating letters in despool, after saving, the system should generate a preview of the letters, but it only writes error, see attachement.\nThanks!'),
