(1255,4,'undefined','Ahojte, \r\n\r\nmám tu 2 prípady, kde sa zle vypočítala provízia. prvý prípad: ručne nahodená žiadosť do EISECU - Auto, číslo žiadosti. 50125862. \r\nSuma vozidla je 10tis., ale klient dáva 4tis. akontáciu - výška úveru je 6tis. požadovaná výška provízie je 10% - mala by byť aj schválená 10%. ale pri tejto sume vyhadzuje poznámku, že max. výška provízie je 1,5% (evidentne províziu počíta resp. pravidlo je nastavené na sumu vozidla, nie na výšku úveru). viď príloha. \r\n\r\n2 prípad je priamo z AAA - 50125844. Tu je cena vozidla 12tis., ale akontácia je 8500, cena úveru je niečo cez 4tis. tak isto ukazuje max. províziu iba 1,5%. \r\n\r\nProblém je pri schvaľovaní - akonáhle sa urobí prepočet nový - tak sa prepočíta provízia podľa zle nastavených parametrov. \r\n\r\nkeby niečo som k dispozícií. '),
