(1298,4,'undefined','Ahojte, vsimla som si jednu vec co sa tyka elektronickeho podpisu zmluv a Extranetu - \n\nStandardny proces bol, že po podpise zmluvy z nasej strany v CofiSigne, sa s automatickou zmenou stavu na \"expedovat\" v extranete zmenila aj farba domceka a zavinaca na zelenu (takto sme uz v zozname ziadosti v Extranete vedeli, ktore ziadosti boli podpisane a expedovane - nebolo potrebne rozklikavat ziadost).\n\nAktualne to vyzera tak, ze aj ked bola dokumentacia podpisana a stav automaticky zmeneny na \"expedovat\", tak domcek aj zavinac ostavaju nezmenene (domcek ostane cierny, zavinac modry) - je potrebne vojst do ziadosti aby sme zistili ci sa zmenil stav na \"expedovat\". \n\nNeviem odkedy to tak je, vsimla som si to len dnes, ale su take vsetky ziadosti s elektronickym podpisom v extranete (kamenne predajne aj eshopy, schvalene a podpisane, aj tie co uz boli odfinancovane).\n\nRobili nejake zmeny?\n\nVopred dakujem.\nZuzana'),
