(1325,1,'Cofisun','\nIn July 2019 there was a higher payment made on the contract 23489, however, this payment was made on the wrong contract, so it was cancelled later on. After the payment was done, the system started an early repayment and this flow was not cancelled after the payment was cancelled so the system still calculates the early repayment and the contract is in debt, although the client pays all his monthly installments correctly. Please, we need you to cancel the early repayment process and recalculate the monthly payments so they include both interest and the principal '),
