(1342,4,'undefined','Ahoj,\nna základe požiadavky z CRIFu sa potrebujem dostať k dokumentu, ktorý by mal byť uložený v zložke Akceptácie na starom PT serveri. Ide o podpísaný súhlas so spracúvaním OÚ k žiadosti č. 19587 na meno Pasiova Iveta.\nKeď sa dostanete na zálohu servera, Zdenko Hrabovský by mohol mať informácie, kde boli tieto dokumenty uložené.\nĎakujem.\nB.'),
