(1344,1,'Cofisun','Ahojte,\n\nPri kontrole nahladov vypisov som natrafila na dva pripady, kde sa mi zda ako keby boli duplicitne nahrate platby.   Vzdy dve platby z jedneho dna a kazda nahrata v iny den\nZmluva 70066728, dve platby zo dna 22.01., ale ta druha pripisana az 03.02. Pri zmluve 90174436 su dve platby hradene 30.12. a druha platba neskor nahrata az 02.01.\nNasledujuci mesiac uhrady zo 24.01., kazda iny den nahrata.\nPo prevereni s uctarnou potvrdeny incident, prikladam printscreen \n\n'),
