(1346,1,'Cofisun','Ahoj,\n\nprosím u EISECu overiť, ako je možné, že máme v systéme zložku a osobné údaje osoby, keď bola zložka vytvorená pravdepodobne v 10/2009. Prikladám print screen - ide o ref. č. 00.726.182.101\n\nTáto zložka mala byť v súlade s kritériami na čistenie databázy vymazaná najneskôr v dobe nasadenia pravidiel do systému.\n\nProsím o overenie, či je takýchto zložiek viac a ak áno, mali by byť vymazané z dôvodu ochrany osobných údajov.\n\nĎakujem.\n\nB.'),
