(439,'Sales department','Informovanie obchodného partnera.\r\nPravidelný report, každý pondelok + na konci mesiaca.\r\nKaždý pondelok pridať do reportu údaje za minulý týždeň. \r\nNásledne vznikne mesačný súhrn.','Prehľad financovaných zmlúv všetkých pobočiek AAA AUTO + Auto Diskont','Číslo zmluvy, užívateľ, dátum prijatia návrhu, názov pobočky, produkt, rok auta, financovaná čiastka, akontácia, počet mesiacov, percento provízie, suma provízia, dátum financovania. ','Zdroje pre report. Cofisun, CV4',2,'marek.fecko@cofidis.sk, erika.magulova@cofidis.sk','2018-10-01 12:00:00',1,1),
(440,'Zsuzsanna Agh','Report pro přecenění ceny vozidel v zabezpečení na aktuální hodnotu k 30/11/rrrr a 31/05/rrrr.\r\nPodle dohody budeme od Eurotaxu požadovat precenění na nejvyšší cenu, pokud budou mít v daných kritériích více cen.\r\n+ zreviduj, prosím, s Edou povinná pole. Chce to po mě vyplnit i archivaci, SFTP a Mail a uložit soubor - což je asi zbytečné...\r\nDěkuji\r\nPB','- produkt - Auto PO, Auto FO, Auto PO Banif, Auto FO Banif\r\n- v zabezpečení - Top Záložné právo počkat na hromadný import na migrovaných smlouvách, pokud nebude do 30/11, bude potřeba dát do reportu všechny migrované smlouvy\r\n- pozice - všechny bez i, Y, H, V','číslo smlouvy\r\nprodukt\r\ndatum otevření smlouvy\r\ntyp vozidla\r\nmodel\r\nverze + motorizace + kW\r\nrok výroby\r\npočet km v okamžiku otevření smlouvy\r\nhodnota vozidla v okamžiku otevření smlouvy\r\nfinancovaná částka\r\ndlužný kapitál','report přístupný a aktualizovatelný ve WEBI',3,'Finance, Controlling, PBO','2018-11-30 12:00:00',NULL,1),
(441,'DAVID SLANINKA','uctovnanie prijatych platieb','\r\nProsim doplnit v stlpci \"popis\" polozky splatok pri autouveroch vid zmluvy za retail a poradove cislo splatky. \r\n\r\nPreco  su hodnoty pozitivne pri autach?\r\n\r\nDakujem\r\n','nedefinovane','nedefinovane',2,'uct. oddelenie','2018-10-12 12:00:00',NULL,2),
