(448,'Zdenko Hrabovský','Sledovanie časov spracovania návrhov na autách podľa schvaľovateľa','Report ako pre sledovanie časov na retaily viď príloha\r\nSledovanie časov:\r\ndo 20 minút\r\ndo 30 minút\r\ndo 40 minút\r\ndo 50 minút\r\ndo 60 minút\r\nnad 60 minút','Meno spracovateľa, počet návrhov celkom, počet návrhov v danom časovom rozmedzí a percentuálne vyjadrenie','frekvencia zasielania reportu každý pondelok, za predchádzajúci týždeň\r\n',2,'Zdenko Hrabovský','2018-10-30 12:00:00',1,1),
(449,'Comliance Risk manager','Naplnenie požiadavky Holdingu na sledovanie počtu žiadostí, kde bolo podozrenie na obchod s politicky exponovanou osobou a vyhodnotenie zhody.','Sledovanie kompetencie PEP pri posudzovaných žiadostiach;\r\nSledovanie, že zodpovedná osoba overila obchod s osobou podozrivou na PEP;\r\nSledovanie, že Vedúci organizačnej zložky dal súhlas k obchodu s PEP.','Obdobie MM/RRRR;\r\nReferenčné číslo;\r\nDodaný TOP PEP \"Podozrenie na politicky exponovanú osobu\" používateľom Moteur Moteur ÁNO / NIE;\r\nPoč. dátum TOPu PEP \"Podozrenie na politicky exponovanú osobu\";\r\nDodaný TOP PEP \"Nie je politicky exponovaná osoba\" / \"Politicky exponovaná osoba\" používateľom Barbora Vyhnalová / Pavlína Borovková ÁNO / NIE - používateľ nie je podstatný, uvádzam len v prípade, že by sa dáta hľadali jednoduchšie, dôležitá je HODNOTA TOPu;\r\nPoč. dátum TOPu PEP \"Nie je politicky exponovaná osoba\" / \"Politicky exponovaná osoba\" \r\nMeno a priezvisko osoby, ktorá posudzovala žiadosť','V prílohe posielam TOPy, ktoré majú byť sledované. Potrebujem všetky žiadosti, kde je TOP PEP s hodnotou \"Podozrenie na politicky exponovanú osobu\". Druhá TOP je kontrola, že prešla zložka cez kompetentné osoby, môže byť aj ÁNO pre TOP PEP Podozrenie a NIE pre druhý TOP.\r\n\r\nReport prosím o vytvorenie do WEBI do zložky AML',3,'Barbora Vyhnalová','2018-10-31 12:00:00',NULL,1),
(450,'Compliance Risk manager','Splnenie odporúčaní z auditu AML uskutočneného Holdingom - kontrola splátok uhrádzaných zo zahraničného bankového účtu.','Zobrazenie zoznamu zmlúv, u ktorých bola uhradená splátka zo zahraničného BÚ. Možnosť vytiahnúť si report za obdobie jedného mesiaca - report vo WEBI.','Číslo zmluvy\r\nDátum platby\r\nVýška platby\r\nČíslo bankového účtu IBAN\r\nMajiteľ bankového účtu\r\n\r\n','Prosím overiť, či je možné nastaviť report z údajov z Cofisunu alebo ak je to možné z údajov z Heliosu tak, aby bolo možné vytvárať a aktualizovať dáta vo WEBI každý mesiac. Prosím report uložiť do WEBI do zložky AML.\r\nV prílohe posielam príklady splátok uhradených zo zahraničného BÚ pre zjednodušenie určenia kritérií.\r\nĎakujem.\r\nB.',3,'Barbora Vyhnalová','2018-11-11 12:00:00',0.5,1),
