(452,'Stanislav Grom','Excel kalkulacka na vypocet a kontrolu hodnot dotahovanych do zmluv - zmluvna dokumentacia','- zoradenie jednotlivých hodnot presne podla poradia v akom su na zmluve\r\n- slovensky aj anglicky preklad v kalkulacke /aby bola pouzitelna aj pre akceptaciu aj pre Eisec/\r\n- pridat do kalkulačky aj hodnotu 1st monthly installment\r\n- pridat do kalkulačky aj hodnotu date of last monthly installment\r\n- opravit hodnotu odplata - zaokruhlovanie na 2 desatine miesta nahor /prosim tuto info este pre istotu preverit/\r\n- nastavenie excelu na \"read-only\"\r\n- opravit hodnotu poistenie + potrebujeme check box aby to bolo co najjednoduchsie pouzitelne aj pre akceptaciu\r\n- doplnenie stlpca \"formula\" + \"example\" v existujucej kalkulacke\r\n','- co najviac user firendly riesenie pre akceptaciu - zobrazit iba udaje, kt. treba kontrolovat so zmluvou, na pozadi by mali prebiehat vypocty','ziadne',1,'Vsetci','2018-11-14 12:00:00',0.5,2),
