(459,'Compliance Risk manažér','Podklad pre prezentáciu pre CODI kvôli projektu GDPR - Purge\r\n\r\nPodklad by mal obsahovať celkový počet žiadostí po mesiacoch za rok 2018 rozdelený na FO, FOP a PO, z toho počet schválených / financovaných žiadostí a z nich zamietnuté žiadosti. Zamietnuté žiadosti prosím ďalej rozdeliť na tie, ktoré boli zamietnuté pred tým, ako prebehla konzultácia CRIF a tie, ktoré boli zamietnuté pred konzultáciou CRIF.','Prosím o vytvorenie 2 reportov:\r\n\r\n1.celkový počet žiadostí\r\nstav - predchválené / schválené / stornované / zamietnuté\r\nrozdelenie žiadostí po jednotlivých mesiacoch Ntimes + Autá\r\ntyp klienta FO, FOP, PO\r\nprebehla u žiadosti konzultácia CRIF? áno / nie\r\n\r\n2. ukončené zmluvy\r\npočet ukončených zmlúv v jednotlivých mesiacoch\r\ncelkový počet aktívnych zmlúv ku koncu jednotlivých mesiacov\r\npočet otvorených zmlúv v danom mesiaci','1.\r\nPerióda\r\nStav žiadosti\r\nTyp klienta\r\nPrebehla konzultácia CRIF áno/nie\r\n\r\n2.\r\ncelkový počet aktívnych zmlúv v portfóliu k poslednému dni v mesiaci\r\npočet ukončených zmlúv v priebehu daného mesiaca\r\npočet otvorených zmlúv v danom mesiaci','Tento report bude jednorázový, potrebujem dáta ako podklad pre prezentáciu na CODI ohľadne prebiehajúceho skupinového projektu.\r\nĎakujem.\r\nB.',3,'Barbora Vyhnalová','2018-12-09 12:00:00',NULL,1),
(460,'Galffyova','účelom reportu je sledovanie úhrad a %rozhradenosti priprodukte auto v pozícii P1N1 do vstupu do vymáhania uzávierky','- Group of contracts: 1st pmnt AUTO\r\n                                  All P1 AUTO\r\n- Number of contracts\r\n- Number of activated contracts Activé , počet rozhradených klientov z celkoveho počtu zmluv v danej skupine\r\n- % of activation to iste ako počet len v %\r\n- Expected amount\r\n- Paid amount očistené od úhrad výššich ako očakávana ciastka\r\n- % of paid amount paid amount/expected amount*100\r\n- Number of unpaid installments počet non activé,\r\n-% of non-payment \r\n-  Number of installments less than 50% of expected amount\r\n- % of non payment for installments less than 50% of expected amount\r\n','- Group of contracts: 1st pmnt AUTO\r\n                                  All P1 AUTO\r\n- Number of contracts\r\n- Number of activated contracts Activé , počet rozhradených klientov z celkoveho počtu zmluv v danej skupine\r\n- % of activation to iste ako počet len v %\r\n- Expected amount\r\n- Paid amount očistené od úhrad výššich ako očakávana ciastka\r\n- % of paid amount paid amount/expected amount*100\r\n- Number of unpaid installments počet non activé,\r\n-% of non-payment \r\n-  Number of installments less than 50% of expected amount\r\n- % of non payment for installments less than 50% of expected amount\r\n','Reporty je potrebne vytvorit dva zvlast. Sledovanie zmluvy od zaciatku mesiaca do vstupu do vymahania uzavierky\r\nNapriklad pre splatnost k 20.temu zaciatok je 1.12.2018 a sledujeme zmluvy do 11.01.2019\r\nV prilohe prikladam na vzor retail, ale potrebujeme len list GLOBAL+ALL',1,'Held, Galffyová Nemeth','2018-12-31 12:00:00',2.5,1),
