(341,4,'tu je vyjadrenie z cr:\r\nDobrý den, \r\n prověřili jsme smlouvu 90378234. Předpokládám, že důvod k tomu, že neodešli notifikace s přístupen do KZ je následující. Pokusím se nastínit celý proces.\r\n\r\nPořadí vytvoření smluv:\r\n 1. Klient podal žádost na smlouvu 90370796. Tato smlouva byla schválena a zboží expedováno.\r\n 2. Klient podal žádost na smlouvu 90378234. Tato smlouvy skončila vestavu „manuální posouzení“.\r\n3. Následně však došlo ke stornu smlouvy 90370796 z Extranet.\r\n 4. Došlo ke schválení smlouvy 90370796, ale neodešli notifikace pro SMS podpis.\r\n\r\nPři vytvoření druhé smlouvy pro stejného uživatele ověřujeme, zda již uživatel má účet v KZ. Pokud ano další nezakládáme a pro smlouvy použijeme jeden účet v KZ. \r\n Tím, že v bodu 3. došlo ke stornu smlouvy 90370796 z Extranet, došlo tím k „deaktivování“ účtu pro KZ v Extranetu a tím i pro smlouvu 90378234. Proto nedošlo k odeslání notifikací. Dle analýzy „COFEXTSK-380“ očekáváme, že ke stornu podepsané smlouvy dojde v KZ viz. sreen a tím dojde k přenosu tohoto stavu do Extranetu.\r\n\r\nCelou situaci jsem nasimuloval ve Vašem testovacím prostředí, kde je možné si toto ověřit. Jedná se o ID žádostí 13947 a 13949. \r\n\r\nPls nech sa klient skusi prihlasit s prihlas.udajmi kt. mu boli zaslane k prvej zmluve + mi dajte vediet ci to ficalo.\r\n\r\ndakujem\r\n\r\nP.','2018-12-13 16:34:16'),
