(1090,4,'Solution	Hello, \n\nI tought this is same problem than SA0000039639848. \nHere, rule for co-debdtor has been applied. \n\nIn fact, LWCAI (Living wage co-applicant set to 147 e) is used in substraction as not in normal calculation for borrower only case. \n\nSo, for this case, we got incomes - (LWA + LWCAI + Children Count * LWCH + LMR + CP_CALCULRB * CRCC + Futur Instalment)\n430 - (211 + 147 + 0 * 96 + 0 + 0.03 * 0 + 72) = 430 - 430 = 0 \nTotal must be Superior to 0. \nAs it is equal, criterion 5813 for rule 146041 is false for CRAUT 1500 e. \n\nBug has been fixed in version 13-08 that will be delivered next week. \n\nBest regards, \nXavier\n\ns tymto vyjadrenim mi tiket zavreli. Buduci tyzden ma byt nasadena nova verzia aj s opravou. Pls o info od Stana ci je to akceptovatelne a mozem zavriet tiket.\n\n\nDakujem\n\nP','2019-11-07 08:02:47'),
